INSERT INTO ReportHelp (ID,ReportCode,ReportHelps)VALUES(67, 'ACCESS',  '<P>This report gives an overview of the file/table accesses. It lists the accesses, including messages and records used, etc. for each file: <UL> <LI><B>File Name</B>: The filename of interest. <LI><B>Busy pct(%)</B>: The sum of the busy time for all instances of the file. <LI><B>Accessed</B>: The sum of the number of records accessed by the file. <LI><B>Used</B>: The sum of the records used by the file. <LI><B>Disk Reads</B>: The sum of all the disk reads by the file. <LI><B>Messages</B>: The sum of messages for the file. <LI><B>Bytes per Message</B>: The number of bytes per message for the file. </LI></UL></P>'),
(73, 'ACUCHRT', '<P>This chart shows the average utilization of each CPU. <UL> <LI><B>CPU</B>: The CPU number. <LI><B>CPU Type</B>: The processor type of that CPU. <LI><B>Total Queue Length</B>: The CPU Queue Time. <LI><B>Total CPU Busy pct(%)</B>: The average CPU utilization. <LI><B>Interrupt Handling pct(%)</B>: Percentage (%) the CPU spent executing interrupt handlers.<LI><B>Primary Disk Process pct(%)</B>: Primary disk process(es) utilization<LI><B>Backup Disk Process pct(%)</B>: Backup disk process(es) utilization<LI><B>Other Processes pct(%)</B>: Other disk process(es) utilization<LI><B>Average CPU Utilization (CPU Utilization)</B>: This is a bar that indicates the above Busy % value along with a breakdown showing the different contributors to the utilization. Blue denotes interrupt handling, green denotes primary disk process(es) utilization, orange denotes backup disk process(es) utilization and maroon denotes the utilization of all other processes. </LI> </UL> </P>'),
(35, 'ADUCHRT', '<P>This graphic chart shows the average utilization of each physical disk drive. <UL> <LI><B>CPU</B>: The CPU that the device is running on. <LI><B>SAC Name</B>: Device SAC Name.<LI><B>$Device</B>: The physical disk drive. An asterisk(*) denotes a CLIM Device.<LI><B>Physical Address</B>: A Low Physical Address is marked with a &#39;-p&#39;. The value is &#39;-m&#39; otherwise. <LI><B>Busy pct(%)</B>: The total utilization of the disk => (Read-Qbusy-Time + Write-Qbusy-Time). <LI><B>Write Busy pct(%)</B>: The percentage (%) time spent writing data.<LI><B>Read Busy pct(%)</B>: The percentage (%) time spent reading data.<LI><B>Average Disk Utilization (Busy pct(%))</B>: This is a bar that indicates the utilization of the device on a percentage (0-100) scale. Blue denotes write busy % and green denotes read busy %. Doing a mouseover the bar shows this % value. </LI> </UL> </P>'),
(36, 'AXLCHRT', '<P> This chart shows native, accelerated and non-accelerated CPU consumption by all programs (that is, all processes, including those run from the $SYSTEM.SYSnn.OSIMAGE file). <UL> <LI><B>Program File Name</B>: The name of the program. If the program name is preceded by a lower-case &#39;x&#39;, that program object file has been accelerated; otherwise it has not been accelerated. <LI><B>Total Share pct(%)</B>: &#39;Total Share pct(%)&#39; shows the Program File Name&#39;s total CPU consumption as a proportion (in percent) of the total CPU time consumed by all processes. <LI><B>TNS Share pct(%)</B>: &#39;TNS Share pct(%)&#39; shows the Program File Name&#39;s non-native, non-accelerated (&#39;TNS&#39;) CPU consumption as a proportion (in percent) of the total CPU time consumed by all processes. <LI><B>Accelerated Share pct(%)</B>: &#39;Accelerated Share pct(%)&#39; shows the Program File Name&#39;s accelerated CPU consumption as a proportion (in percent) of the total CPU time consumed by all processes. <LI><B>Native Share pct(%)</B>: &#39;Native Share pct(%)&#39; shows the Program File Name&#39;s native CPU consumption as a proportion (in percent) of the total CPU time consumed by all processes. </LI></UL></P>'),
(37, 'BLKSPLT', '<P>This chart shows which disk files are experiencing the most block splits, ordered by descending block splits (summed over all opens of any given file/partition). Only files experiencing block splits are shown. <UL><LI><B>Program File Name</B>: The name of the disk file. <LI><B>Total Splits</B>: The total number of block splits. <LI><B>Cumulative Share pct(%)</B>: Cumulative share % of the total block splits. <LI><B>Share pct(%)</B>: Individual percentage share of the total block splits. <LI><B>Disk File Block Split Shares(Share pct(%))</B>: This is a bar chart showing the above value graphically on a percentage (0-100) scale. </LI></UL></P>'),
(7,  'CACHE1' , '<P>This report shows the disk device cache utilization for each disk. Save the first two columns, there are four groups for the each of the columns, one for each valid DP2 cache block size. <UL><LI><B>$Device</B>: The Disk Name. An asterisk(*) denotes a CLIM Device.<LI><B>Kilobytes Allocated</B>: The number of kilobytes allocated. <LI><B>Blocks Allocated</B>: The number of Blocks Allocated. <LI><B>Blocks Dirty</B>: The number of Dirty Blocks. <LI><B>Hits per Sec</B>: Cache Hits per second. <LI><B>Misses per Sec</B>: Cache Misses per second. <LI><B>Faults per Sec</B>: Cache Faults per second. <LI><B>Audit Faults per Sec</B>: Audit buffer forces per second. </LI></UL></P>'),
(24, 'CACHE2' , '<P>This report shows the disk device cache allocation for each disk. Save the first two columns, there are four groups for the each of the columns, one for each valid DP2 cache block size. Within those, the last three groups have an additional &#39;Total&#39; column <UL><LI><B>$Device</B>: The Disk Name. An asterisk(*) denotes a CLIM Device.<LI><B>Kilobytes Allocated</B>: The number of kilobytes allocated. <LI><B>Disk CACHE Allocation</B>: The number of Blocks Allocated. <LI><B>Kilobytes Allocated</B>: The number of kilobytes allocated. <LI><B>Average Cache Hits per Second</B>: Average Cache Hits per second. <LI><B>Average Cache Misses per Second</B>: Average Cache Misses per second. </LI></UL></P>'),
(52, 'COVER'  , '<P>This chart is a &quot;cover page&quot; for the set of reports, showing global information (date/time of MEASUREment, system MEASUREd, numbers and types of CPUs, etc.) For each of the key performance indicators, it shows the total, average, lowest and highest values. <br><br><B>Note</B>: &quot;The Memory Queue Length&quot; value will be reported as zero since MEM-QTIME is always zero. This is because as of G05, the handling of page-faulting is a system library function. No queuing occurs because multiple requests are processed concurrently.</P>'),
(1,  'CPUREPT', '<P>This report shows the overall activity in each CPU during the measurement interval (Window) <UL><LI><B>CPU</B>: The CPU Number.<LI><B>Type</B>: The CPU type. <LI><B>MB</B>: The CPUs real memory (1MB = 1,048,576 bytes). <LI><B>PCBs</B>: The configured number of Process Control Blocks. <LI><B>LCBs</B>: The configured number of Link Control Blocks. This value is no longer used and will always be reported as zero. <LI><B>Queue Length Total</B>: The average number of processes in the CPU queue. This value includes the currently active process, any process(es) that are ready to use the CPU, and any process(es) that are waiting for memory page faults to be serviced. <LI><B>Queue Length Memory</B>: The average memory queue length. As of G05, the handling of page-faulting is a system library function. No queuing occurs because multiple requests are processed concurrently. As a result, this value is always zero. <LI><B>Process Busy pct(%)</B>: The percentage of the measurement window spent executing process code. <LI><B>Interrupt Busy pct(%)</B>: The percentage of the measurement window spent executing interrupt handler code. <LI><B>Total Busy pct(%)</B>: The percentage of the measurement window that the CPU was busy i.e. the sum of <SPAN id=lblHtml1>Process Utilization</SPAN> and <SPAN id=lblHtml2>Interrupt Utilization</SPAN>. <LI><B>Process Overhead pct(%)</B>: The percentage of the measurement window spent creating and deleting processes. <LI><B>Send Busy pct(%)</B>: The percent of time spent sending messages to other CPUs. This counter is not used for G-Series and later RVUs. <LI><B>Memory Swaps per Sec</B>:&nbsp; The average number of memory swap operations (both into and out of memory) performed per second by the Memory Manager process in the CPU; each swap operation transfers one or two pages. <LI><B>Process Dispatches per Sec</B>: The average number of process dispatches per second. <LI><B>Cache Hits per Sec</B>: The average number of Disk Cache &quot;hits&quot; per second, aggregated over all disk devices primaried in the CPU; a cache &quot;hit&quot; occurs when the required block is found in the Disk Cache, thus saving a physical I/O operation. <LI><B>Disk I/Os per Sec</B>: The average number of disk I/O transfers performed per second by all Disk Processes in the CPU; seek operations are not included. Note that one write to a mirrored device requires two disk I/O transfers. <LI><B>Static Process Count</B>: The number of static processes that ran in the CPU; this report considers a &quot;static&quot; process to be one that existed for (FLAG)% or more of the measurement window. <LI><B>Transient Process Count</B>: The number of transient processes that ran in the CPU; this report considers a &quot;transient&quot; process to be one that existed for less than (FLAG) % of the measurement window. </LI></UL></P>'),
(68, 'DATACOM', '<P>This report produces an overview of non-EXPAND communication lines. <UL><LI><B>$Device</B>: The line name. <LI><B>Retries</B>: Flag indicating whether retries occurred. <LI><B>Requsts per Sec</B>: Number of requests per second. <LI><B>Input Bits per Sec</B>: Number of input bits per second. <LI><B>Input Bits Zero (*)</B>: Flag indicating whether input-bytes are less than zero, and reply-bytes are used to calculate above number. <LI><B>Output Bits per Sec</B>: Number of input bits per second. <LI><B>Output Bits Zero (*)</B>: Flag indicating whether output-bytes are less than zero, and received-bytes are used to calculate above number. <LI><B>CPU Busy pct(%)</B>: The primary I/O process CPU busy %. <LI><B>Receive Queue (ms) per Request</B>: The primary I/O process receive queue milliseconds per request. <LI><B>Ready (ms) per Request</B>: The primary I/O process CPU busy milliseconds per request. <LI><B>Input Bytes per Request</B>: The average input bytes per request. <LI><B>Input Bytes Zero (*)</B>: Flag indicating whether input-bytes are less than zero, and reply-bytes are used to calculate above number. <LI><B>Output Bytes per Request</B>: The average output bytes per request. <LI><B>Output Bytes Zero (*)</B>: Flag indicating whether output-bytes are less than zero, and received-bytes are used to calculate above number. <LI><B>Primary I/O Process Name (if-Multi-line)</B>: The actual primary I/O process name if line is MULTI-ed. </LI></UL><BR><BR><B>NOTE</B>: An &#39;<B>*</B>&#39; following a Bit or Byte value indicates that the value was zero in the LINE entity; the value has been taken instead from the &#39;received bytes&#39; (output) or &#39;reply bytes&#39; (input) counter of the Primary I/O Process.</P>'),
(37, 'DCPCHRT', '<P>This chart shows each logical disk device&#39;s Disk Cache &quot;performance&quot;; the measure of &quot;performance&quot; is the device&#39;s cache misses expressed as a percentage of the sum of its cache hits and cache misses. This chart typically displays an optimistic view of each device&#39;s cache performance. The chart displays cache MISS percentage, rather than cache HIT percentage, because this provides a more dramatic indication of the performance improvements that might be gained by optimizing disk cache sizes and utilizations. <UL><LI><B>$Device</B>: The name of the logical disk device. An asterisk(*) denotes a CLIM Device.<LI><B>Requests per Sec</B>: Number of requests per second. <LI><B>Cache (Hits + Misses) per Sec</B>: The sum of the number of cache hits and misses per second. <LI><B>Cache Misses pct(%)</B>: The number of cache misses expressed as a percentage of the sum of the cache hits and misses. <LI><B>Cache Hits pct(%)</B>: The number of cache hits expressed as a percentage of the sum of the cache hits and misses. <LI><B>Disk Cache Performance(Cache Hits and Misses pct(%))</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. <table style=''border:0''> <tr><td style=''width: 20px; background:blue; padding:0px 0px 0px 0px; border:0''></td><td style=''border:0''>Cache Misses %</td></tr> </table> </LI></UL><BR><BR><B>NOTE</B>: An exclamation point (<B>!</B>) following the &#39;Cache (H+M)&#39; column indicates more than three Cache accesses per request. This may indicate a more-than-desirable number of index levels in a key-sequenced file or table.</P>'),
(51, 'DCUCHRT', '<P>This chart shows each Disk Process&#39; CPU utilization. It displays both primary and backup Disk Process CPU utilizations. <UL><LI><B>$Device</B>: The disk device name. An asterisk(*) denotes a CLIM Device.<LI><B>Primary CPU</B>: The primary CPU of the device. <LI><B>Backup CPU</B>: The backup CPU of the device. <LI><B>CPU Busy pct(%)</B>: The total CPU utilization of the device. <LI><B>Primary CPU Busy pct(%)</B>: The primary CPU utilization of the device. <LI><B>Backup CPU Busy pct(%)</B>: The backup CPU utilization of the device. <LI><B>Disk Process Utilization (CPU Busy pct(%))</B>: This is the bar chart showing the above CPU utilization values graphically on a percentage (0-100) scale. Blue denotes the share of the primary CPU busy while orange denotes the share of the backup CPU busy. </LI></UL></P>'),
(42, 'DFIODST', '<P>This chart shows the Disk File I/O Activity distribution across Devices and CPUs and is intended as an aid to file balancing. The report presents the &#39;CPU -> Disk -> File&#39; hierarchy, with the most &#39;active&#39; entity at each level shown first. That is, the first CPU shown is that with the highest sum of Cache Hits and Disk I/Os (its percentages of the system-wide totals of each of these values is shown). The first Disk Device shown for each CPU is that with the highest sum of Cache Hits and Disk I/Os within its CPU (its percentage of the CPU&#39;s totals of each of these values is also shown). The first File (or Partition) shown for each Disk Device is that with the highest total &#39;Driver Calls&#39; on the Device (again, its percentage of the Device&#39;s totals of Cache Hits and Driver Calls minus Cache Hits is also shown). Progressively less active Files or Partitions on the Device are then shown, followed by progressively less active Devices within the CPU, followed by progressively less active CPUs.<BR> &quot;Estimated Utilization Shift&quot; represents the estimated amounts by which the utilizations of the Disk Device&#39;s primary CPU (CPU) and primary drive (Disk) would drop if the file or partition were moved entirely off its current Disk Device to a Device primaried in a different CPU. If the Device is mirrored, the mirror driver&#39;s utilization would normally be expected to drop by an amount similar to the primary driver&#39;s. These are &#39;absolute&#39; values; that is, a &#39;CPU&#39; value of (for example) 12.7 means that the CPU utilization would drop from (for example) 52.7% to 40.0% if the file were moved. <BR> The utilizations of the primary CPU and drive(s) to which the file or partition is moved could normally be expected to increase by similar amounts, if work were to continue to be processed at the same rate following the move. Such, of course, may not be the case. <BR> The CPU utilization shift is estimated on the assumption that a physical I/O (Driver Call minus Cache Hit) is 2.0 times as CPU-costly as a Cache Hit. You can change this assumption by specifying the TPRODUCE <option> &#39;IOFACTOR <value>&#39; when you run this query. The default value for IOFACTOR is 2.0, the same default as is used by the Tandem Capacity Model (TCM). <UL> <LI><B>CPU</B>: The CPU number. <LI><B>CPU&#39;s pct(%) of Total Cache Hits</B>: CPU&#39;s contribution to system-wide Cache Hits. <LI><B>CPU&#39;s pct(%) of Total Disk I/Os</B>: CPU&#39;s contribution to system-wide Disk I/Os. <LI><B>$Device</B>: Disk device name. An asterisk(*) denotes a CLIM Device. <LI><B>Device&#39;s pct(%) of CPU Cache Hits</B>: Device&#39;s contribution to (primary) CPU&#39;s Cache Hits. <LI><B>Device&#39;s pct(%) of CPU Disk I/Os</B>: Device&#39;s contribution to (primary) CPU&#39;s Disk I/Os. <LI><B>^</B>: This sign indicates that the logical volume name of that file is different from the name of the physical disk device on which the file resides. <LI><B>SubVolume</B>: Disk file/partition subvolume. <LI><B>Filename</B>: Disk file/partition filename. <LI><B>File&#39;s pct(%) of Device Cache Hits</B>: File&#39;s contribution to Device&#39;s Cache Hits/Physical I/Os. <LI><B>File&#39;s pct(%) of Device Disk I/Os</B>: File&#39;s contribution to Device&#39;s Physical I/Os. <LI><B>Estimated CPU Utilization Shift</B>: Estimated CPU utilization of Primary Disk Process in servicing Cache & I/O activity for the file. <LI><B>Estimated Disk Utilization Shift</B>: Estimated utilization of the (primary) disk drive servicing I/O activity for the file. </LI></UL></P>'),
(77, 'DFLEANA', '<P>This report shows the logical I/Os against files. The list is grouped by the physical volume (device).<UL><LI><B>Physical Volume</B>: Device name.<LI><B>Logical Filename</B>: File system name, qualified file name.<LI><B>File Type</B>: Unstructured / Relative / Entry-sequenced / Key-sequenced.<LI><B>Transient Opens Count</B>: The number of times the file was opened by a transient process.<LI><B>Driver Input Calls</B>: The number of read operations.<LI><B>Cache Misses</B>: The number of cache misses of the sum of the cache hits and misses.<LI><B>Driver Output Calls</B>: The number of write operations.<LI><B>Cache Write Misses</B>: The number of cache write misses.<LI><B>Block Splits</B>: The number of Block Splits. <LI><B>Lock Wait Time</B>: The time spent waiting for locks.</LI></UL></P>'),
(43, 'DFOATBL', '<P>This chart provides an overview of disk file activity. The table is ordered by file name (not qualified by volume or subvolume), to provide quick reference capabilities. This ordering also tends to group alternate key files close to their primary files, and to group all partitions of a partitioned file together. <UL> <LI><B>File Name</B>: Name of the disk file. <LI><B>Volume</B>: Volume where the file is located. <LI><B>SubVolume</B>: Subvolume where the file is located. <LI><B>SQL/MX Table/Index</B>: Flag to define if it is a TABLE or INDEX. <LI><B>SQL/MX Table/Index Name</B>: The TABLE/INDEX definition of the ANSI SQL Name.<LI><B>SQL/MX Partition Name</B>: The PARTITION definition of the ANSI SQL Name, if available.<LI><B>Total Opens</B>: Number of times this file has been opened.<LI><B>File-Type</B>: This letter indicates the file structure (Entry-Sequenced(E), Key-Sequenced(K), Relative(R), Unstructured()). <LI><B>Logical I/Os per Sec</B>: Logical I/Os per second. <LI><B>System I/Os per Sec</B>: System I/Os (&#39;driver calls&#39;) per second. <LI><B>Physical I/Os per Sec</B>: Physical I/Os per second. <LI><B>Cache Hits pct(%)</B>: Cache hit percentage. <LI><B>Lock Waits pct(%)</B>: Percentage of logical requests that encountered record or file locks. <LI><B>(ms) per Logical I/O</B>: Average milliseconds per logical I/O. </LI></UL></P>'),
(49, 'DFOSTBL', '<P>This chart shows an overview of disk file activity. The table is ordered by descending system I/O count to provide a quick global overview of the busiest disk files on the MEASUREd system. <UL> <LI><B>Volume</B>: Volume where the disk file is placed. <LI><B>SubVolume</B>: Subvolume where the disk file is placed. <LI><B>File Name</B>: Disk file name. <LI><B>File Opens</B>: Number of times this file has been opened.<LI><B>File-Type</B>: This letter indicates the file structure (Entry-Sequenced(E), Key-Sequenced(K), Relative(R), Unstructured()). <LI><B>Logical I/Os per Sec</B>: Logical I/Os per second. <LI><B>System I/Os per Sec</B>: System I/Os (&#39;driver calls&#39;) per second. <LI><B>Physical I/Os per Sec</B>: Physical I/Os per second. <LI><B>Cache Hits pct(%)</B>: Cache hit percentage. <LI><B>Lock Waits pct(%)</B>: Percentage of logical requests that encountered record or file locks. <LI><B>(ms) per Logical I/O</B>: Average milliseconds per logical I/O. </LI></UL></P>'),
(38, 'DFPI/Os' , '<P>This chart gives an overview of disk file physical I/O count distribution, ordered by descending total physical I/Os (summed over all opens of any given logical disk file/partition), so the files for which applications cause the most physical I/Os are at the top of the list. <UL> <LI><B>$Volume.SubVol.FileName</B>: File name. <LI><B>Physical I/Os per Sec</B>: Physical I/Os on the file per second. <LI><B>Flags</B>: Flags for non-zero requests blocked (L), block splits (S) and remote I/Os (R). <LI><B>Cumulative Share pct(%)</B>: Cumulative share of the total physical I/Os. <LI><B>Share pct(%)</B>: Individual share of the total physical I/Os. </LI></UL></P>'),
(39, 'DFSI/Os' , '<P>This chart provides an overview of disk file &#39;system&#39; I/O count distribution, ordered by descending total driver calls (summed over all opens of any given logical disk file/partition), so the files for which applications cause the most &#39;system&#39; I/Os are at the top of the list. <UL> <LI><B>$Volume.SubVol.FileName</B>: File name. <LI><B>I/Os per Sec</B>: System I/Os on the file per second. <LI><B>Flags</B>: Flags for non-zero requests blocked (L), block splits (S) and remote I/Os (R). <LI><B>Cumulative Share pct(%)</B>: Cumulative share of the total driver calls. <LI><B>Share pct(%)</B>: Individual share of the total driver calls (&#39;system&#39; I/Os). <LI><B>Disk File System I/O Shares(Share pct(%))</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. </LI></UL></P>'),
(40, 'DIOCHRT', '<P>This chart shows the average I/O rates of each physical disk drive. <UL> <LI><B>CPU</B>: The CPU that the device is running on. <LI><B>SAC Name</B>: Device SAC Name. <LI><B>$Device</B>: The physical disk drive. An asterisk(*) denotes a CLIM Device. <LI><B>Physical Address</B>: A low physical address is marked with a &#39;-p&#39;. The value is &#39;-m&#39; otherwise. <LI><B>Total I/Os per Sec</B>: The total I/O rate for the device. <LI><B>Write I/Os per Sec</B>: The write I/O rate for the device. <LI><B>Read I/Os per Sec</B>: The read I/O rate for the device. <LI><B>Disk I/Os per Sec (Device I/Os per Sec)</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. The bar shows the breakdown of the Read I/Os (orange) and the Write I/Os (blue). </LI></UL></P>'),
(25, 'DIOHOGS', '<P>This report shows the disk I/O &quot;heavy hitters&quot;. It helps identify the physical file/table/index partitions (&quot;files&quot; in the following descriptions) experiencing the most system I/Os, and then to identify the individual open(er)s causing those system I/Os. <UL> <LI><B>pct(%) of Total System I/Os</B>: Percentage of Total Measured Sys I/Os for the busiest physical &quot;files&quot;. <LI><B>pct(%) of Total Physical I/Os</B>: Percentage of Total Measured Phys I/Os for the busiest physical &quot;files&quot;. <LI><B>Physical File Name</B>: The physical name of the file/table/index/partition. <LI><B>pct(%) of Physical File&#39;s System I/Os</B>: Percentage of Physical File&#39;s Measured Sys I/Os for the busiest open(er)s. <LI><B>pct(%) of Physical File&#39;s Physical I/Os</B>: Percentage of Physical File&#39;s Measured Phys I/Os for the busiest open(er)s. <LI><B>From Time (hh:mm:ss)</B>: From Timestamp. <LI><B>To Time (hh:mm:ss)</B>: To Timestamp. <LI><B>System</B>: System Name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>Process Name</B>: Process Name of Opener (n/a if opener is on remote system). <LI><B>Program File Name</B>: Program file name of opener (n/a if opener is on remote system). </LI></UL></P>'),
(78, 'DOPNANA', '<P>This report shows the physical I/Os against files. The list is grouped by the physical volume (device).<UL><LI><B>Physical Volume</B>: Device name.<LI><B>Logical File Name</B>: File system name, qualified file name.<LI><B>File Type</B>: Unstructured / Relative / Entry-sequenced / Key-sequenced.<LI><B>Open By</B>: PID of the opener process.<LI><B>Driver Input Calls</B>: The number of read operations.<LI><B>Cache Misses</B>: The number of cache misses.<LI><B>Driver Output Calls</B>: The number of write operations.<LI><B>Cache Write Misses</B>: The number of cache write misses.<LI><B>Block Splits</B>: Number of Block Splits per second.<LI><B>Lock Wait Time</B>: Time spent waiting for locks.<LI><B>Average Wait Time</B>: The average time spent waiting for locks.</UL></p>'),
(50, 'DPMEMRY', '<P>This chart shows Disk Process memory utilization within each CPU. <UL> <LI><B>CPU</B>: CPU number. <LI><B>Memory (MB)</B>: Total CPU memory pages. <LI><B>Fault</B>: Flag indicating whether device is experiencing cache faults. <LI><B>$Device</B>: The disk device name. An asterisk(*) denotes a CLIM Device.<LI><B>Percentage Of - CPU Memory Primary</B>: Percentage of CPU&#39;s memory used by device&#39;s Disk Process group (shown under either the &quot;Primary&quot; or the Backup column, but not both. <LI><B>Percentage Of - CPU Memory Backup</B>: Percentage of CPU&#39;s memory used by device&#39;s Disk Process group (shown under either the &quot;Primary&quot; or the Backup column, but not both; a fairly significant proportion of a Backup&#39;s memory can be locked memory (un/redo chains)). <LI><B>Percentage Of Totals For All Devices In CPU - Memory Used Primary</B>: Memory used (Primary) as a percentage of the sum of the memory for all Disk Process groups within the CPU. <LI><B>Percentage Of Totals For All Devices In CPU - Memory Used Backup</B>: Memory used (Backup) as a percentage of the sum of the memory for all Disk Process groups within the CPU. <LI><B>Percentage Of Totals For All Devices In CPU - Logical Requests</B>: Number of logical requests as a percentage of the sum of the requests for all Disk Process groups within the CPU. <LI><B>Percentage Of Totals For All Devices In CPU - System I/Os</B>: Number of System I/Os as a percentage of the sum of the System I/Os for all Disk Process groups within the CPU. <LI><B>Percentage Of Totals For All Devices In CPU - Cache Hits pct(%)</B>: Cache hits as a percentage of the sum of the Cache Hits for all Disk Process groups within the CPU. <LI><B>Percentage Of Totals For All Devices In CPU - Physical I/Os</B>: Number of Physical I/Os as a percentage of the sum of the Physical I/Os for all Disk Process groups within the CPU. </LI></UL><BR><BR><B>NOTE</B>: An exclamation point (<B>!</B>) preceding a Device name indicates that the Device experienced at least one Cache Fault. See &#39;Disk CACHE Activity&#39; Report, or the &#39;Disk SubSystem Activity&#39; Report for the actual Cache Fault rates</P>'),
(2,  'DPREPT',  '<P>This report shows the overall activity of Disk processes during the measurement interval (Window). It also includes some minimal information on the associated physical disks.</P><P>The report shows only Disk processes that received at least 0.10 requests for service per second.<UL> <LI><b>$Device</b>: The Disk device name. An asterisk(*) denotes a CLIM Device. <LI><b>PC:BC</b>: The Disk Processes primary and backup CPU numbers.<LI><b>Request per Sec</b>: The average number of requests for service received per second.<LI><b>Average Queue per Service External (ms)</b>: The average time, in milliseconds, that requests for service spent in the Disk Process EXTERNAL queue <LI><b>Average Queue per Service Internal (ms)</b>: The average time, in milliseconds, that requests for service spent in the Disk Process INTERNAL queue, after having been read from the external queue; this time includes both queuing and service times. Internal queuing of requests may be caused by such things as: contention for the CPU, contention for Disk Cache semaphores, contention for the I/O Channel, I/O Controller(s) or the physical disk(s), or application-level contention for locked records or files. <LI><b>Average Queue per Service Total (ms)</b>: The sum of Q/Serv External (M-Sec) and Q/Serv Internal (M-Sec). thus, this is the average &quot;response time&quot; experienced by a request for service.<LI><b>Disk Process Primary (ms) per Request</b>: The average number of CPU milliseconds consumed by the primary Disk Process(es) per request for service.<LI><b>Disk Process Backup (ms) per Request</b>: The average number of CPU milliseconds consumed by the backup Disk Process(es) per request for service.<LI><b>Disk Process Total (ms) per Request</b>: The sum of Disk Process Total (millisec/req) and Disk Process Backup (millisec/req).<LI><b>Disk (ms) per Request</b>: The average number of DISC milliseconds consumed per request for service. The reported value takes into account whether the device is mirrored or unmirrored and, for mirrored devices, assumes that the device is performing parallel writes; if, in fact, the device is performing serial writes, then the value shown here may underestimate the disk time per request.<LI><b>Disk Process Primary Resources Busy pct(%)</b>: The percentage of the measurement window that the primary Disk Processes were using their CPU.<LI><b>Disk Process Backup Resources Busy pct(%)</b>: The percentage of the measurement window that the backup Disk Processes were using their CPU.<LI><b>Disk Process Total Resources Busy pct(%)</b>: The sum of Disk Process Backup (Res Busy %) and Disk Process Primary (Res Busy %).<LI><b>Disk Primary Resources Busy pct(%)</b>: The percentage of the measurement window that the primary disk drive was busy seeking, reading or writing.<LI><b>Disk Mirror Resources Busy pct(%)</b>: The percentage of the measurement window that the mirror disk drive (if any) was busy seeking, reading or writing.<LI><b>Swap I/Os per Sec</b>: The average number of I/O transfers per second that were carried out on behalf of the Memory Manager processes in the system. These values may be greater than the values reported in the CPU Report &quot;swaps per second&quot; column, since a Disk Process may per form more than one I/O transfer per &quot;swap&quot; operation performed by a Memory Manager process.<LI><b>Free I/Os per Sec</b>: The average number of I/O operations per second to the Disk Free Space table. This table must be accessed and updated whenever space is allocated or deallocated on the device. <LI><b>Block Splits per Request</b>: The average number of data or index block splits per request for service; block splits in unaudited files or tables require several physical I/Os.</LI></UL></P>'),
(54, 'DRTCHRT', '<P>This chart shows the average &quot;response time&quot;, in milliseconds, of each disk device. This &quot;response time&quot; is the sum of the average time that a request message spends in the request queue (external to the Disk Process), and the average time that a request spends WITHIN the Disk Process (both queued and in service). <UL> <LI><B>Primary CPU</B>: The primary CPU for disk device. <LI><B>Low SAC Name</B>: The low physical address. <LI><B>High SAC Name</B>: The high physical address. <LI><B>$Device</B>: The disk device. An asterisk(*) denotes a CLIM Device.<LI><B>Reqsuests per Sec</B>: Number of requests per second. <LI><B>Requests Blocked pct(%)</B>: Number of requests blocked per second. <LI><B>Response Time (ms)</B>: The average response time, in milliseconds, of each device. <LI><B>External Queuing (ms)</B>: The average external queuing time, in milliseconds, of each device. <LI><B>CPU Time (ms)</B>: The average CPU time, in milliseconds, of each device. <LI><B>Disk Time (ms)</B>: The average Disk time, in milliseconds, of each device. <LI><B>CPU Contention (ms)</B>: The average CPU contention time, in milliseconds, of each device. <LI><B>Other Contention (ms)</B>: The average other contention time, in milliseconds, of each device. <LI><B>Disk Response Time (Milliseconds)(Disk Response Time)</B>: This is the bar chart showing the above response time values graphically. The highest response time spans the entire chart length while the rest of the values are scaled accordingly. Blue denotes the External Queue time, green denotes the Disk Process CPU time, orange denotes the Physical Disk time (compensated for unmirrored or mirrored drives, assuming parallel writes for mirrored drives), maroon denotes CPU contention time and light blue denotes Other (Contention) time. Other (contention) time possible causes include: <br>a. Application-level contention for &quot;popular&quot; locked records or files; this chart shows the percentage of all requests that encounter record or file locks (the &quot;% Blkd&quot; column). <br>b. Relatively long-lived requests; examples: <br> &nbsp;&nbsp;&nbsp;- CONTROL-27 (write notification) request on a file to which writes are done infrequently (although I believe DP2 now &quot;clocks off&quot; such a request until a write actually happens), <br> &nbsp;&nbsp;&nbsp;- TMP &quot;permission to delete audit trail&quot; request. <br>c. Contention for Disk Cache semaphores, <br>d. Chart thinks mirrored device capable of parallel writes, but writes are actually occurring serially (the TMF Audit Trail volume can be an example of this). </LI></UL></P><table style=''border:0''> <tr><td style=''width: 20px; background:blue; padding:0px 0px 0px 0px; border:0''></td> <td style=''border:0''>External Queue time</td></tr> <tr><td style=''width: 20px; background:00ff00; padding:0px 0px 0px 0px; border:0''></td> <td style=''border:0''>Disk Process CPU time</td></tr> <tr><td style=''width: 20px; background:orange; padding:0px 0px 0px 0px; border:0''></td> <td style=''border:0''>Physical Disk time</td></tr> <tr><td style=''width: 20px; background:maroon; padding:0px 0px 0px 0px; border:0''></td><td style=''border:0''>CPU contention time</td></tr> <tr><td style=''width: 20px; background:33FFFF; padding:0px 0px 0px 0px; border:0''></td> <td style=''border:0''>Other (Contention) time</td></tr> </table> </LI></UL><BR><B>NOTE</B>: For a mirrored device, &#39;Disk time&#39; is based on the assumption that the device is performing parallel writes; if it is, in fact, performing serial writes, this may be contributing to any &#39;Other contention&#39; shown in the device&#39;s plot line.</P>'),
(3,  'DSCREPT', '<P>This report shows Disk subsystem activity over the measurement interval (Window). For the purposes of this report, a Disk subsystem is composed of the Disk processes (including Disk cache) and the physical Disk device(s) that comprise a physical volume; The left half of the report shows Disk process and Disk cache activity, while the right half of the report shows physical Disk activity<UL> <LI><b>$Device</b>: The Disk device name. An asterisk(*) denotes a CLIM Device.</LI> <LI><b>Kilobytes Allocated</b>: The Logical Device Number of the disk device.</LI> <LI><b>Requests per Sec</b>: The average number of requests for service received per second.</LI> <LI><b>Average Requests in Internal Queue</b>: The average number of requests for service on the Disk Processes &quot;internal&quot; queue.</LI> <LI><b>Average Time in Internal Queue (ms)</b>: The average time in milliseconds that requests for service spent in the Disk Processes &quot;internal&quot; queue.</LI> <LI><b>Average Blocked pct(%)</b>: The percentage of requests for service that encountered record or file locks (and were therefore impeded from further forward progress until locks were released). This value tends to show a strong positive correlation to both IQlen and IQmsec, above.</LI><br><br> <li>The following is a group of columns showing the key Disk Cache activities per request for service received by the Disk Processes: <ul>  <LI><b>Cache per Request Hit</b>: The average number of times per request that a required block was found in cache on a read or buffered write operation, aggregated over all ache block sizes; each &quot;hit&quot; saves a disk I/O. Not all disk requests through the Disk Cache (for example, writes to TMF audit trails bypass the cache).</LI>  <LI><b>Cache per Request Miss</b>: The average number of times per request that a required block was not found in cache on a read operation, aggregated over all cache block sizes; each &quot;miss&quot; causes a disk I/O. Not all disk requests through the Disk Cache (for example, writes to TMF audit trails bypass the cache).</LI>  <LI><b>Cache per Request Faults</b>: The average number of times per request that cache tables indicated that a needed block was in cache, but the Memory Manager had &quot;stolen&quot; the underlying memory for another purpose, aggregated over all cache block sizes. This typically indicates either too large a cache size, or too little real memory for the CPU.  <LI><b>Cache per Request Audit Buffer Force</b>: The average number of times per request that the Disk Process had to write to the TMF audit trail volume before it could write a &quot;dirty&quot; cache block and so free that block for another use, aggregated over all cache block sizes. This value should be close to zero.</LI> </ul> </li><br><br> <LI><b>Primary CPU</b>: The CPU of the primary Disk Process.</LI> <LI><b>Group</b>: The Group of the disk(s) under control of the primary Disk Process.&nbsp; </LI> <LI><b>Module</b>: The Module of the disk(s) under control of the primary Disk Process.&nbsp; </LI> <LI><b>Slot</b>: The Slot of the disk(s) under control of the primary Disk Process.&nbsp; </LI> <LI><b>Busy Percent Total</b>: The percentage of the window that the disk was thru busy, in total.</LI> <LI><b>Busy Percent Read</b>: The percentage of the window that the disk was thru busy, in each reading activity.</LI> <LI><b>Busy Percent Write</b>: The percentage of the window that the disk was thru busy, in each writing activity.</LI> <LI><b>Busy Percent Seek</b>: The percentage of the window that the disk was thru busy, in each seeking activity. All seek operations are implicit in read and write operations. As a result, this column is reported as zero. </LI> <LI><b>I/Os per Request Total</b>: The average number of I/O operations per request for service, in total.</LI> <LI><b>I/Os per Request Read</b>: The average number of I/O operations per request for service, in each reading activity.</LI> <LI><b>I/Os per Request Write</b>: The average number of I/O operations per request for service, in each writing activity.</LI> <LI><b>I/Os per Request Seek</b>: The average number of I/O operations per request for service, in each seeking activity. All seek operations are implicit in read and write operations. As a result, this column is reported as zero.</LI> </UL> </P>'),
(53, 'EXPAND',  '<P>This chart shows a tabular overview of EXPAND communication lines. <UL> <LI><B>$Device</B>: The EXPAND line name. <LI><B>Requests per Sec</B>: The number of Requests per Second. <LI><B>Input Level-2 Bits per Sec</B>: Input Bits per Second. <LI><B>Output Level-2 Bits per Sec</B>: Output Bits per Second. <LI><B>CPU Busy pct(%)</B>: Primary I/O Process CPU Busy %. <LI><B>Queue Received per Request (ms)</B>: Primary I/O Process Receive Queue in Milliseconds per Request. <LI><B>Ready per Request (ms)</B>: Primary I/O Process CPU Busy in Milliseconds per Request. <LI><B>User Data Input Bytes per Request</B>: Average Input Bytes per Request. <LI><B>User Data Output Bytes per Request</B>: Average Output Bytes per Request. <LI><B>Primary I/O Process Name (if-Multi-line)</B>: Actual Primary I/O Process Name if line is MULTI-ed. </LI></UL></P>'),
(26, 'FILOPNS', '<P>This report shows the open(er)s of one or more files. <UL> <LI><B>File Name</B>: File that is opened. <LI><B>From Time (hh:mm)</B>: Time the file was opened. <LI><B>To Time (hh:mm)</B>: Time the file was closed. <LI><B>Average Reads per Sec</B>: Average reads per second over report window. <LI><B>Average Updates per Sec</B>: Average updates (replies) per second over report window. <LI><B>Average Deletes per Sec</B>: Average deletes (wr-reads) per second over report window. <LI><B>Average Writes per Sec</B>: Average writes per second over report window. <LI><B>Average File Info Calls per Sec</B>: Average file(rec)info calls per second over report window. <LI><B>Average Total Logical I/Os per Sec</B>: Average total logical I/O&#39;s per second over report window. <LI><B>Opener Process Name</B>: Process Name of the opener process. <LI><B>Process ID (CPU|PIN)</B>: PID of the opener process. <LI><B>Priority</B>: Priority of the opener process. <LI><B>Opener Program File Name</B>: File name of the opener process. <LI><B>Average (ms) per Logical I/O</B>: Average elapsed milliseconds per logical I/O. </LI></UL></P>'),
(27, 'HAYSTCK', '<P>This report shows specific opens (Of NonStop SQL tables) that exhibit low &#39;Selectivity&#39;; i.e. Where the ratio of records used to records accessed is relatively small. In some instances, re-wording an SQL statement or adding an alternate index may result in many fewer records (rows) being accessed in order to satisfy the statement; in other instances, low selectivity scans are unavoidable. For the unavoidable cases, partitioning the table across many disk volumes connected to many CPUs can result in a dramatic improvement in the time required to return query results, since NonStop SQL Release 2&#39;s Parallel Query Execution feature can utilize all available resources in parallel (look for &#39;$SYSTEM.SYSTEM.SQLESP&#39; in the OPENING PROCESS Program File Name column). <UL> <LI><B>System Name</B>: System Name.<LI><B>File Name</B>: The physical file name of the table; the report is sorted by this name and, within this name, by time of opening. <LI><B>Volume</B>: The volume name of the table; this will often be the name of the &#39;root&#39; partition, but it may also be the name of an &#39;extra&#39; partition. <LI><B>SubVolume</B>: The subvolume name of the table; this will often be the name of the &#39;root&#39; partition, but it may also be the name of an &#39;extra&#39; partition. <LI><B>From Time (hh:mm)</B>: The time hh:mm of this particular table OPEN (or of the start of the measurement window, whichever comes later). <LI><B>To Time (hh:mm)</B>: The time hh:mm of this particular table CLOSE (or of the end of the measurement window, whichever comes earlier). <LI><B>Selectivity pct(%)</B>: The selectivity of table accesses made via this open; i.e., the number of records USED divided by the number of records ACCESSED, expressed as a percentage. Note that a selectivity of .0001% implies that approximately ONE IN A MILLION of the records accessed was actually used; blanks in this column indicate a selectivity less than .00005%. This report shows only opens with a selectivity less than or equal to 1.0000%. <LI><B>Average per Second - Window Records Accessed</B>: The number of records ACCESSED per second, averaged over the measurement window; this report EXCLUDEs opens that accessed less than 0.10 records per second, when averaged over the measurement window. <LI><B>Average per Second - Window Disk Reads</B>: The number of physical disk READS per second, averaged over the measurement window. <LI><B>Average per Second - Open Records Accessed</B>: The number of records ACCESSED per second, averaged over the life of the particular OPEN. <LI><B>Average per Second - Open Disk Reads</B>: The number of physical disk READS per second, averaged over the life of the particular OPEN. <LI><B>Opening Processes - Process Name</B>: The name of the process that opened the table; since MEASURE may record a File open slightly before it records the Process itself, this report ALLOWs the starting timestamp of a File record to be as much as 5.00 seconds earlier than that of the Process. <LI><B>Opening Processes - Process ID (CPU|PIN)</B>: The PID cpu,pin of the opening process. <LI><B>Opening Processes - Priority</B>: The execution priority of the opening process; Disk Processes service requests according to the priorities of the requesters. In order not to degrade the performance of more critical transactions (if any) that execute concurrently with processes reported on here, these low-selectivity processes should usually have execution priorities below those of processes that service the more critical transactions. <LI><B>Opening Processes - Program File Name</B>: The program file name of the opening process. Any process running from the $SYSTEM.SYSTEM.SQLESP file is a copy of the NonStop SQL Executor Server Process that accomplishes automatic parallel query execution on behalf of application SQL statements. <LI><B>Average (sec) per Logical I/O</B>: The average elapsed SECONDS per LOGICAL table I/O; this includes time spent accessing unused records. </LI></UL></P>'),
(9,  'IOWOVER', '<P>This report shows the busiest disk files on all volumes, in terms of total file busy (wait) time. The report aggregates all OPENs of the same file in to one report line. All counts are in units per second. <UL> <LI><B>System</B>: The name of the system where the disk file resides. <LI><B>Volume</B>: The volume name where the disk file is located. <LI><B>SubVolume</B>: The subvolume name where the disk file is located. <LI><B>File Name</B>: The disk file name. <LI><B>Total Opens</B>: Number of times this file has been opened.<LI><B>I/O Wait Share pct(%)</B>: File&#39;s file busy (wait) time as percentage of global total. <LI><B>Logical I/O Share pct(%)</B>: File&#39;s logical I/O count as percentage of volume total.<LI><B>(ms) per Logical I/O)</B>: Average milliseconds per logical I/O. <LI><B>Flags</B>: Flags for Lock Waits (L), Timeouts or Cancels (T), and Escalations (E). <LI><B>Logical I/O per Second - Total</B>: Logical I/O counts (total). <LI><B>Logical I/O per Second - Reads</B>: Logical I/O counts (reads). <LI><B>Logical I/O per Second - Updates</B>: Logical I/O counts (updates). <LI><B>Logical I/O per Second - Deletes</B>: Logical I/O counts (deletes). <LI><B>Logical I/O per Second - Writes</B>: Logical I/O counts (writes). <LI><B>Logical I/O per Second - Info</B>: Logical I/O counts (info). <LI><B>Message Logical I/O</B>: Number of messages sent per logical I/O. <LI><B>Bytes per Message</B>: Average bytes per message sent. <LI><B>Selectivity pct(%)</B>: Selectivity % (records used divided by records accessed). <LI><B>Disk Reads per Logical I/O</B>: Number of disk reads per logical I/O. </LI></UL></P>'),
(75, 'IPUCHRT', '<P>This report shows the distribution of load over IPUs per CPU, per interval. Values displayed represent the average of Process CPU time consumed by all processes running in each IPU during each interval. Total available percentage of CPU resource is displayed at 100 percent, times the number of IPUs. This represents a 100 percent availability ceiling per IPU. Distribution of load over IPUs per CPU is handled automatically by the Operating System.</P>'),
(74, 'IPUOVER', '<P>This report shows the overall distribution of load over IPUs per CPU, averaged for the duration of the analyses. Values displayed represent the average of Process CPU time consumed by all processes running in each IPU for the duration of time this analyses covers. Total available percentage of CPU resource is displayed at 100 percent, times the number of IPUs. This represents a 100 percent availability ceiling per IPU. Distribution of load over IPUs per CPU is handled automatically by the Operating System.</P>'),
(44, 'LDFIOWT', '<P>This chart shows an overview of the logical disk file I/O wait time distribution, ordered by descending file busy time (summed over all opens of any given logical disk file), so the files on which applications spend the longest time waiting are at the top of the list. <UL> <LI><B>$Volume.SubVol.FileName</B>: The logical disk file name. <LI><B>Logical I/Os per Sec</B>: Logical disk file I/Os per second. <LI><B>Flags</B>: Flags for non-zero lock waits (L), timeouts (T) and escalations (E). <LI><B>Cumulative Share pct(%)</B>: Cumulative share of total file busy time. <table style=''border:0''> <tr><td style=''width: 20px; background:blue; padding:0px 0px 0px 0px; border:0''></td><td style=''border:0''>Share %</td></tr></table> <LI><B>Individual Share pct(%)</B>: Individual share of total file busy time. <LI><B>Logical Disk File I/O Wait Shares(Share pct(%))</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. </LI></UL><BR><BR><B>NOTE</B>: An exclamation point (<B>!</B>) following a File Name indicates that accesses to the file are experiencing an average wait time per logical I/O that is greater than the overall system average.</P>'),
(28, 'LIOBVOL', '<P>This report shows the busiest disk files on each volume, in terms of total logical I/O requests. The report aggregates all OPENs of the same file in to one report line. All counts are in units per second. <UL> <LI><B>$Volume.Subvol.Filename</B>: File system name, qualified file name. <LI><B>Total Open</B>: Number of times this file has been opened.<LI><B>I/O Wait Share pct(%)</B>: File&#39;s file busy (wait) time as percentage of volume total. <LI><B>Logical I/O Share pct(%)</B>: File&#39;s logical I/O count as percentage of volume total. <LI><B>(ms) per Logical I/O</B>: Average milliseconds per logical I/O. <LI><B>Flags</B>: Flags for Lock Waits (L), Timeouts or Cancels (T), and Escalations (E). <LI><B>Logical I/O&#39;s per Sec Total</B>: Logical I/O counts (total). <LI><B>Logical I/O&#39;s per Sec Reads</B>: Logical I/O counts (reads). <LI><B>Logical I/O&#39;s per Sec Updates</B>: Logical I/O counts (updates). <LI><B>Logical I/O&#39;s per Sec Deletes</B>: Logical I/O counts (deletes). <LI><B>Logical I/O&#39;s per Sec Writes</B>: Logical I/O counts (writes). <LI><B>Logical I/O&#39;s per Sec Information</B>: Logical I/O counts (info). <LI><B>Messages per Logical I/O</B>: Number of messages sent per logical I/O. <LI><B>Bytes per Message</B>: Average bytes per message sent. <LI><B>Selectivity pct(%)</B>: Selectivity % (records used divided by records accessed). <LI><B>Disk Reads per Logical I/O</B>: Number of disk reads per logical I/O. </LI></UL></P>'),
(29, 'LIOOVER', '<P>This report shows the busiest disk files on all volumes, in terms of total logical I/O operations. <UL> <LI><B>System</B>: The name of the system where the disk file resides. <LI><B>$Volume</B>: The volume name where the disk file is located. <LI><B>SubVolume</B>: The subvolume name where the disk file is located. <LI><B>File Name</B>: The disk file name. <LI><B>I/O Wait Share pct(%)</B>: File&#39;s file busy (wait) time as percentage of global total. <LI><B>Logical I/O Share pct(%)</B>: File&#39;s logical I/O count as percentage of global total. <LI><B>Average (ms) per Logical I/O</B>: Average milliseconds per logical I/O. <LI><B>Flags</B>: Flags for Lock Waits (L), Timeouts or Cancels (T), and Escalations (E). <LI><B>Logical I/O per Second Total</B>: Logical I/O counts (total). <LI><B>Logical I/O per Second Reads</B>: Logical I/O counts (reads). <LI><B>Logical I/O per Second Updates</B>: Logical I/O counts (updates). <LI><B>Logical I/O per Second Deletes</B>: Logical I/O counts (deletes). <LI><B>Logical I/O per Second Writes</B>: Logical I/O counts (writes). <LI><B>Logical I/O per Second Info</B>: Logical I/O counts (info). <LI><B>Number of Messages Sent per Logical I/O</B>: Number of messages sent per logical I/O. <LI><B>Average Bytes per Message Sent</B>: Average bytes per message sent. <LI><B>Selectivity pct(%)</B>: Selectivity % (records used divided by records accessed). <LI><B>Disk Reads per Logical I/O</B>: Number of disk reads per logical I/O. </LI></UL></P>'),
(10, 'NETREPT', '<P>This report shows the EXPAND Network Line Activity. This report sums these values over the device name, since lines may be down and up again result in multiple MEASURE records per line. Note that, for multi-line EXPAND paths, this report contains separate report lines for the PATH handler and for each LINE handler. Not all counter values are reported for each of these entity types. <UL> <LI><B>$Device</B>: Device Name. <LI><B>Requests per Sec</B>: Requests per second. <LI><B>Reads per Sec</B>: Input transfers per second. <LI><B>Write per Sec</B>: Output transfers per second. <LI><B>Read Busy pct(%)</B>: Read utilization (usually close to 100%). <LI><B>Write Busy pct(%)</B>: Write utilization. <LI><B>User Data Input Bits per Sec</B>: User data input bits per second (before decompression). <LI><B>Level-2 Input Bits per Sec</B>: Level 2 input bits per second (link level). <LI><B>User Data Output Bits per Sec</B>: User data output bits per second (after compression). <LI><B>Level-2 Output Bits per Sec</B>: Level 2 output bits per second (link level). <LI><B>Message Distribution pct(%) <64 Bites</B>: Compressed message size distributions. <LI><B>Message Distribution pct(%) <128 Bites</B>: Compressed message size distributions. <LI><B>Message Distribution pct(%) <256 Bites</B>: Compressed message size distributions. <LI><B>Message Distribution pct(%) <512 Bites</B>: Compressed message size distributions. <LI><B>Message Distribution pct(%) <1024 Bites</B>: Compressed message size distributions. <LI><B>Message Distribution pct(%) <2048 Bites</B>: Compressed message size distributions. <LI><B>Message Distribution pct(%) <4096 Bites</B>: Compressed message size distributions. <LI><B>Level-2 User Data Input Ratio</B>: Input &quot;overhead&quot; (level 2 bytes versus user data bytes). <LI><B>Level-2 User Data Output Ratio</B>: Output &quot;overhead&quot; (level 2 bytes versus user data bytes). </LI></UL></P>'),
(11, 'NEWPROC', '<P>This report shows new process creations in each of 16 time intervals. Width of interval, in minutes, is specified by the user (PARAM INTERVAL <mm>), or is computed by dividing the time span of measurement into 16 equal intervals. The user can also specify a PARAM named BEGIN, to set the offset in minutes (from midnight on the day the measurement started) from which to start the &quot;time line&quot;. <UL> <LI><B>File Name</B>: Program file name. <LI><B>Total</B>: Total number of executions found for each program. <LI><B>MM/DD/YYYY HH:MM:SS - # Processes</B>: Number of processes existing for at least part of each interval. </LI></UL></P>'),
(30, 'PALPHA',  '<P>This report shows the processes in all CPUs, in alphabetic process name order. <UL> <LI><B>Process Name</B>: The process name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>IPU Number</B>: the number of the IPU on which the process was executing when the sample was taken.<LI><B>IPU Switches</B>: Indicates the total number of times that a process switched IPUs while executing.<LI><B>Priority</B>: Priority of the process. <LI><B>Program File Name</B>: The program file name. <LI><B>Flag &#39;*&#39;</B>: Indication whether the process was running for less than the percentage of time specified by the FLAG parameter. <LI><B>Average Received Queue (ms)</B>: Average time messages spent on $RECEIVE queue. <LI><B>Average Memory (MB)</B>: Average memory used, in MB. <LI><B>CPU Busy pct(%) Individual</B>: Individual CPU busy time. <LI><B>CPU Busy pct(%) Cumulative</B>: CPU utilization (as percentage of measurement window). <LI><B>Ready:Busy</B>: Ratio of total ready time to CPU busy time. <LI><B>Message Received per Sec</B>: Messages received per second. <LI><B>Message Sent per Sec</B>: Messages sent per second. <LI><B>Sent:Received</B>: Ratio of messages sent to messages received. <LI><B>CPU (ms) per Message Received</B>: Average CPU milliseconds consumed per message received. <LI><B>CPU (ms) per Message Sent</B>: Average CPU milliseconds consumed per message sent. </LI></UL></P>'),
(12, 'PATHWAY', '<P>This report shows the PATHWAY Transaction Processing Software processes. <UL> <LI><B>Program</B>: The program name. <LI><B>Process Name</B>: The process name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>Average Received Queue (ms)</B>: Average time messages spent on $RECEIVE queue. <LI><B>Total Memory Queue (sec)</B>: Total time spent on MemoryManager queue. <LI><B>Average Memory (MB)</B>: Average memory MB used. <LI><B>CPU Busy (sec)</B>: Total CPU busy time. <LI><B>CPU Busy pct(%)</B>: CPU utilization (as percentage of measurement window). <LI><B>Priority</B>: Priority. <LI><B>Ready:Busy</B>: Ratio of total ready time to CPU busy time. <LI><B>Messages per Sec Received</B>: Messages received per second. <LI><B>Messages per Sec Sent</B>: Messages sent per second. <LI><B>Sent:Received</B>: Ratio of messages sent to messages received. <LI><B>CPU (ms) per Message Received</B>: Average CPU milliseconds consumed per message received. <LI><B>CPU (ms) per Message Sent</B>: Average CPU milliseconds consumed per message sent. </LI></UL></P>'),
(13, 'PBSYCPU', '<P>This report shows the busiest processes in each CPU. <UL> <LI><B>Process Name</B>: The process name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>IPU Number</B>: the number of the IPU on which the process was executing when the sample was taken.<LI><B>IPU Switches</B>: Indicates the total number of times that a process switched IPUs while executing.<LI><B>Priority</B>: Priority of the process. <LI><B>Program File Name</B>: The program file name. <LI><B>Flag &#39;*&#39;</B>: Indication whether the process was running for less than the percentage of time specified by the FLAG parameter. <LI><B>Average Receive Queue (ms)</B>: Average time messages spent on $RECEIVE queue. <LI><B>Average Memory (MB)</B>: Average memory MB used. <LI><B>CPU Busy pct(%) Individual</B>: Total CPU busy time. <LI><B>CPU Busy pct(%) Cumulative</B>: CPU utilization (as percentage of measurement window). <LI><B>Ready:Busy</B>: Ratio of total ready time to CPU busy time. <LI><B>Messages Received per Sec</B>: Messages received per second. <LI><B>Messages Sent per Sec</B>: Messages sent per second. <LI><B>Sent:Received</B>: Ratio of messages sent to messages received. <LI><B>CPU (ms) per Message Received</B>: Average CPU milliseconds consumed per message received. <LI><B>CPU (ms) per Message Sent</B>: Average CPU milliseconds consumed per message sent. </LI></UL></P>'),
(31, 'PBSYOVR', '<P>This report shows the busiest processes in each CPU. <UL> <LI><B>Process Name</B>: The process name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>IPU Number</B>: the number of the IPU on which the process was executing when the sample was taken.<LI><B>IPU Switches</B>: Indicates the total number of times that a process switched IPUs while executing.<LI><B>Priority</B>: Priority of the process. <LI><B>Program File Name</B>: The program file name. <LI><B>Flag &#39;*&#39;</B>: Indication whether the process was running for less than the fraction of time specified by the FLAG parameter. <LI><B>Average Received Queue (ms)</B>: Average time messages spent on $RECEIVE queue. <LI><B>Average Memory (MB)</B>: Average memory MB used. <LI><B>CPU Busy pct(%) Individual</B>: Total CPU busy time. <LI><B>CPU Busy pct(%) Cumulative</B>: CPU utilization (as percentage of measurement window). <LI><B>Ready:Busy</B>: Ratio of total ready time to CPU busy time. <LI><B>Message Received per Sec</B>: Messages received per second. <LI><B>Message Sent per Sec</B>: Messages sent per second. <LI><B>Sent:Received</B>: Ratio of messages sent to messages received. <LI><B>CPU (ms) per Message Received</B>: Average CPU milliseconds consumed per message received. <LI><B>CPU (ms) per Message Sent</B>: Average CPU milliseconds consumed per message sent. </LI></UL></P>'),
(55, 'PCBLCB',  'This produces a table of PCB types found, and of MEASURE-d LCB Usage. It is intended to be usable for CYCLONE Limits reduction analysis. <UL>Catagorizes the processes as: <LI> OSIMAGE, <LI> Unnamed (not NonStop, not Restartable), <LI> NonStop pairs, <LI> Restartable. </LI></UL> Based on this categorization, and the user&#39;s PARAM ALLOW <n> value (default = number of CPUs found in measurement), it shows the estimated average PCBs per CPU, calculated using the three methods given in the CYCLONE Limits reduction document, for both ALLOW and for (ALLOW + 1). It also shows the sum of average LCBs in use, and the sum of maximum LCBs in use. <UL> <LI>PCB Analysis <UL> <LI><B>OS Image PCBs</B>: The OSIMAGE PCBs. <LI><B>Non-named PCBs</B>: The non-named, non-OSIMAGE PCBs. <LI><B>NonStop User PCBs</B>: The NonStop &quot;user&quot; PCBs. <LI><B>Restartable User PCBs</B>: The restartable &quot;user&quot; PCBs. <LI><B>Total PCBs</B>: The total PCBs. <LI><B>Average PCBs per CPU (i CPUs) (1)</B>: Total number of PCBs divided by the number of CPUs i. <LI><B>Average PCBs per CPU (i CPUs) (2) </B>: (Total PCBs without the per CPU share of the OSImg PCBs) divided by the (number of CPUs minus one). <LI><B>Average PCBs per CPU (i CPUs) (3)</B>: (Total PCBs including the per CPU share of the Rstrt PCBs) divided by the (number of CPUs minus one). <LI><B>Average PCBs per CPU (i+1 CPUs) (1)</B>: Total number of PCBs divided by the number of CPUs plus one (i+1). <LI><B>Average PCBs per CPU (i+1 CPUs) (2)</B>: (Total PCBs without the per CPU share of the OSImg PCBs) divided by the number of CPUs. <LI><B>Average PCBs per CPU (i+1 CPUs) (3)</B>: (Total PCBs including the per CPU share of the Rstrt PCBs) divided by the number of CPUs). </LI></UL> </LI> <LI>LCB Analysis <UL> <LI><B>Avg Inuse (SUM)</B>: The sum of the average LCBs in use. <LI><B>Max Inuse (SUM)</B>: The sum of the maximum LCBs in use. </LI></UL> </LI></UL> </P>'),
(56, 'PCOUNTS', 'This chart catagorizes CPU utilization by process &quot;type&quot;. It also shows execution counts for each process &quot;type&quot;. The following process categories are reported on: <UL> <LI><B>Disk Processes</B>: The processes with priority >= 219 and process name not equalling &quot;$IPB&quot;. <LI><B>Other GUARDIAN Processes</B>: Processes with name &quot;$IPB&quot; or those with priority >199 and <210 , name not equalling &quot;$TMP&quot; or having pin 4 . <LI><B>TMF Subsystem</B>: The processes with name &quot;$TMP&quot; or pin 4 or of files with names equalling &quot;BACKOUT2&quot; or &quot;SNOOP&quot; or beginning with &quot;TMF&quot;. <LI><B>SPOOLER Subsystem</B>: The processes of files with names that begin with &quot;PERUSE&quot; or contain &quot;SPOOL&quot;. <LI><B>Command Interpreters</B>: The processes of files with names &quot;COMINT&quot; or &quot;TACL&quot;. <LI><B>Editors/Formatters</B>: The processes of files with names &quot;EDIT&quot;, &quot;TEDIT&quot;, &quot;TTEXT&quot;, &quot;VS&quot;, &quot;TGAL&quot; or &quot;TFORM&quot;. <LI><B>Compilers</B>: The processes of files with names &quot;BIND&quot;, &quot;BINSERV&quot;, &quot;BASIC&quot;, &quot;C&quot;, &quot;C2&quot; , &quot;CROSSREF&quot;, &quot;DDL&quot;, &quot;FORTRAN&quot;, &quot;SQLCOBOL&quot;, &quot;SQLCOMP&quot;, &quot;SYMSERV&quot;, or &quot;TAL&quot; or names beginning with &quot;ADA&quot;, &quot;COBOL&quot;, &quot;PASCAL&quot; or &quot;SCOBOL&quot;. <LI><B>Queries, Reports & Sorts</B>: The processes of files with names &quot;QP&quot;, &quot;FASTSORT&quot;, &quot;SORT&quot;, &quot;SORTPROG&quot;, &quot;SQLCI&quot;, &quot;SQLCI2&quot; or &quot;SQLUTIL&quot; or names beginning with &quot;ENFORM&quot; or &quot;SQLESP&quot;. <LI><B>Utilities</B>: The processes of files with names &quot;CMI&quot;, &quot;CUP&quot;, &quot;DCOM&quot;, &quot;DSAP&quot;, &quot;FUP&quot;, &quot;PUP&quot;, &quot;SCUP&quot; or &quot;SCF&quot; or names starting with &quot;BACKUP&quot; or &quot;RESTORE&quot;. <LI><B>Batch Control</B>: The processes of files whose name contains &quot;BATCH&quot;. <LI><B>PATHWAY: PATHCOMs</B>: The processes of files with name &quot;PATHCOM&quot;. <LI><B>PATHWAY: PATHMONs</B>: The processes of files with name &quot;PATHMON&quot;. <LI><B>PATHWAY: TCPs</B>: The processes of files whose name begins with &quot;PATHTCP&quot;. <LI><B>PATHWAY: User Servers</B>: The processes of files whose volume is not &quot;$SYSTEM&quot; or whose subvolume does not begin with &quot;SYS&quot;. <LI><B>PATHWAY: ENABLE Servers</B>: The processes of files with name &quot;ENABLEGS&quot;. <LI><B>Performance: MEASURE</B>: The processes of files whose name begins with &quot;MEAS&quot;. <LI><B>Performance: Other Tools</B>: The processes of files with names &quot;PEEK&quot;, &quot;VIEWSYS&quot; or names beginning with &quot;NSS&quot; or &quot;LITE&quot;. </LI> </UL> </P>'),
(33, 'PCPUPRI', '<P>This report shows the processes in each CPU, ordered by descending Priority and CPU Busy. <UL> <LI><B>Process Name</B>: The process name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>IPU Number</B>: the number of the IPU on which the process was executing when the sample was taken.<LI><B>IPU Switches</B>: Indicates the total number of times that a process switched IPUs while executing.<LI><B>Priority</B>: Priority of the process. <LI><B>Program File Name</B>: The program file name. <LI><B>Flag &#39;*&#39;</B>: Indication whether the process was running for less than the percentage of time specified by the FLAG parameter. <LI><B>Average Received Queue (ms)</B>: Average time messages spent on $RECEIVE queue. <LI><B>Average Memory (MB)</B>: Average memory used, in MB. <LI><B>CPU Busy pct(%) Individual</B>: Total CPU busy time. <LI><B>CPU Busy pct(%) Cumulative</B>: CPU utilization (as percentage of measurement window). <LI><B>Ready:Busy</B>: Ratio of total ready time to CPU busy time. <LI><B>Message Received per Sec</B>: Messages received per second. <LI><B>Message Sent per Sec</B>: Messages sent per second. <LI><B>Sent:Received</B>: Ratio of messages sent to messages received. <LI><B>CPU (ms) per Message Received</B>: Average CPU milliseconds consumed per message received. <LI><B>CPU (ms) per Message Sent</B>: Average CPU milliseconds consumed per message sent. </LI></UL></P>'),
(14, 'PDISCIO', '<P>This report shows the physical disk I/O activity. <UL> <LI><B>Device</B>: Device name. An asterisk(*) denotes a CLIM Device.<LI><B>Kilobytes Allocated</B>: The number of kilobytes allocated. <LI><B>Requests per Sec</B>: Requests per second. <LI><B>Average Service (ms)</B>: Internal queue time. <LI><B>Primary CPU</B>: The CPU of the primary Disk Process. <LI><B>SAC Name</B>: The SAC Name of the disk(s) under control of the primary Disk Process. <LI><B>Total Busy pct(%)</B>: Disk percent busy. <LI><B>I/Os per Second - Reads</B>: Reads per second. <LI><B>I/Os per Second - Writes</B>: Writes per second. <LI><B>I/Os per Second - Seeks</B>: Seeks per second, reported as zero since all seek operations are now implicit in read and write operations. <LI><B>Averages per I/O - Input</B>: Bytes transferred in per second. <LI><B>Averages per I/O - Output</B>: Bytes transferred out per second. <LI><B>Averages per I/O - Total</B>: Total bytes transferred per second (in and out). <LI><B>Read Bytes</B>: Average bytes per I/O (in). <LI><B>Write Bytes</B>: Average bytes per I/O (out). <LI><B>Read (ms)</B>: Average milliseconds per physical I/O (in). <LI><B>Write (ms)</B>: Average milliseconds per physical I/O (out). </LI></UL></P>'),
(57, 'PDOVIEW', 'This chart gives an overview of the performance of each physical disk drive. It shows the primary (driving) CPU, Group-Module-Slot, and key device statistics. <UL> <LI><B>Primary CPU</B>: The Primary CPU for the disk drive. <LI><B>SAC Name</B>: The SAC Name for the disk drive. <LI><B>$Device</B>: The device name. An asterisk(*) denotes a CLIM Device.<LI><B>Physical Address</B>: This flag indicates whether the disk has a low physical address (-p) or high physical address (-m). <LI><B>Requests per Sec</B>: Requests per second (for primary drive only). <LI><B>Cache Missed pct(%)</B>: Cache miss percentage (for primary drive only). <LI><B>Device Busy pct(%)</B>: Disk busy (as percentage of window). <LI><B>Read I/O per Sec</B>: I/O operations per second involving reads. <LI><B>Read KBytes per Sec</B>: Kilobytes transferred per second during reads. <LI><B>Read Bytes per I/O</B>: Average bytes per I/O operation involving a read. <LI><B>Write I/O per Sec</B>: I/O operations per second involving writes. <LI><B>Write KBytes per Sec</B>: Kilobytes transferred per second during writes. <LI><B>Write Bytes per I/O</B>: Average bytes per I/O operation involving a write. </LI></UL> </P>'),
(58, 'PERROW',  '<P>This chart catagorizes CPU consumption by process &quot;type&quot;. It also shows execution counts for each process &quot;type&quot;. CPU consumption is expressed in CPU milliseconds per record-accessed and per record-used. The former is probably more informative for Disk Processes, the latter for SQLCI(2), SQLESP and (possibly) SORT. <UL> <LI><B>Process Catagory</B>: The type of process (disk, spooler, pathway, etc.). <LI><B>Count</B>: The count of the processes of that type. <LI><B>CPU (sec)</B>: The total CPU cycles in seconds consumed by all the processes of that type. <LI><B>Busy pct(%)</B>: The percentage share of the CPU consumed by all the processes of that type. <LI><B>(ms) per Records Accessed</B>: The CPU consumption expressed as the number of milliseconds per record accessed. <LI><B>(ms) per Records Used</B>: The CPU consumption expressed as the number of milliseconds per record used. </LI></UL> </P>'),
(15, 'PFLTCPU', '<P>This report shows the processes in each CPU that suffered the most from page fault activity. <UL> <LI><B>Process Name</B>: Process name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>IPU Number</B>: the number of the IPU on which the process was executing when the sample was taken.<LI><B>IPU Switches</B>: Indicates the total number of times that a process switched IPUs while executing.<LI><B>Priority</B>: Priority of the process. <LI><B>Program File Name</B>: The program file name. <LI><B>Flag &#39;*&#39;</B>: Indication whether the process was running for less than the percentage of time specified by the FLAG parameter. <LI><B>Memory Queue (sec) Individual</B>: Total time spent on MemoryManager queue. <LI><B>Memory Queue (sec) Cumulative</B>: Cumulative sum of the above. <LI><B>Page Faults Individual</B>: Total page faults. <LI><B>Page Faults Cumulative</B>: Cumulative sum of the above. <LI><B>Faults per Sec Individual</B>: Faults per second. <LI><B>Faults per Sec Cumulative</B>: Cumulative sum of the above. <LI><B>Memory (MB) Average</B>: Average memory MB used. <LI><B>Memory (MB) Maximum</B>: Maximum memory MB used. <LI><B>CPU Busy pct(%)</B>: CPU utilization (as percentage of measurement window). <LI><B>Ready:Busy Total</B>: Ratio of total ready time to CPU busy time. <LI><B>Ready:Busy Memory Queue</B>: Ratio of ready time to time spent on MemoryManager queue. </LI></UL></P>'),
(45, 'PGDIOWT', '<P>This chart shows an overview of logical disk file I/O wait times by programs, where &quot;programs&quot; are all processes running from the same program object file. <UL> <LI><B>Program File Name</B>: Program file name. <LI><B>Logical I/Os per Sec</B>: Logical disk file I/Os per second. <LI><B>Flags</B>: Flags for non-zero lock waits (L), timeouts (T) and escalations (E). <LI><B>Cumulative Share pct(%)</B>: Cumulative share of all logical disk file I/O wait times. <table style=''border:0''> <tr><td style=''width: 20px; background:blue; padding:0px 0px 0px 0px; border:0''></td><td style=''border:0''>Share %</td></tr> </table> <LI><B>Individual Share pct(%)</B>: Program&#39;s share of all logical disk file I/O wait times. <LI><B>Program Disk File I/O Wait Shares(Share pct(%))</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. </LI></UL><BR><BR><B>NOTE</B>: An exclamation point (<B>!</B>) following a Program File Name indicates that processes in the group are experiencing an average wait time per disk file logical I/O that is greater than the overall system average.</P>'),
(59, 'PGLIOWT', '<P>This chart provides an overview of logical file I/O wait times by programs, where &quot;programs&quot; are all processes running from the same program object file. Only disk files and spooler files are charted. <UL> <LI><B>Program File Name</B>: The program file name. <LI><B>Logical I/Os per Sec</B>: The number of logical I/Os per second for the program. <LI><B>Flags</B>: Flags for non-zero lock waits (L), timeouts (T) and escalations (E). <LI><B>pct(%) Share</B>: Program&#39;s percentage share of all logical file I/O wait times. <LI><B>Cumulative Share pct(%)</B>: This is the cumulative percentage share of the logical file I/O wait times. <LI><B>Disk pct(%)</B>: This is the Disk percentage share of the logical file I/O wait times.<LI><B>Spooler pct(%)</B>: This is the Spooler percentage share of the logical file I/O wait times.<LI><B>% Share of Total</B>: This is the bar chart showing the above percentage value graphically on a percentage scale. Blue denotes the I/O wait time due to disk, while green denotes the I/O wait time due to spooler. </LI></UL></P>'),
(71, 'PGOPENS', '<P>This report provides an overview of logical file opens by programs, where &quot;programs&quot; are all processes running from the same program object file. <UL> <LI><B>Program Filename</B>: The program file name. <LI><B>100+ Opens</B>: Flag indicating whether atleast one process executed more than hundred opens. <LI><B>Share %</B>: Program&#39;s share of all logical file opens. <LI><B>Share</B>: This is a bar chart showing the share % above with the breakdown on types of processes. Blue denotes the % due to disk files, green denotes the share of spooler files, orange is for process files while maroon denotes other files. <LI><B>Cumlv Share %</B>: Cumulative share of all logical file opens. </LI> </UL> </P>'),
(60, 'PGOVIEW', '<P>This chart provides a &quot;program overview&quot; table. For each unique program file name (except &quot;OSIMAGE&quot; and &quot;TSYSDP2&quot;), it produces one set of data aggregated over all running copies of the program. <UL> <LI><B>Program File Name</B>: The program file name. <LI><B>Message Received per Sec</B>: The total messages received per second. This report may cover NonStop process pairs. It attempts to allow for this fact by considering, and reporting, &quot;messages received&quot; to be (MESSAGES-RECEIVED - CHECKPOINTS). This should be pretty accurate for programs that use the standard Guardian Check pointing facility, since one CHECKPOINT by the primary process equals one MESSAGE-RECEIVED by the backup process. This compensation will not work for process pairs that implement fault-tolerance using &quot;hot&quot; backups and regular I/O to keep their backups current, since the CHECKPOINTS counter will be zero for such programs. <LI><B>Average Received Queue (ms)</B>: Average receive queue miliseconds per &quot;message received&quot;. <LI><B>Total</B>: The total of the CPU Busy, CPU Wait and Memory Wait values per &quot;message received&quot; (if > 0). <LI><B>s1</B>: This column is marked with an &quot;s&quot; if the total value in the previous column is per second. <LI><B>CPU Busy</B>: The CPU milliseconds consumed per &quot;message received&quot; (if > 0). <LI><B>s2</B>: This column is marked with an &quot;s&quot; if the CPU Busy value in the previous column is per second. <LI><B>CPU Wait</B>: The milliseconds spent waiting for CPU per &quot;message received&quot; (if > 0). <LI><B>s3</B>: This column is marked with an &quot;s&quot; if the CPU Wait value in the previous column is per second. <LI><B>Memory Wait</B>: The milliseconds spent on the Memory Queue per &quot;message received&quot; (if > 0). <LI><B>s4</B>: This column is marked with an &quot;s&quot; if the Memory Wait value in the previous column is per second. <LI><B>I/O Wait</B>: The milliseconds spent waiting for logical I/O operations to all file types per &quot;message received&quot; (if > 0). <LI><B>s5</B>: This column is marked with an &quot;s&quot; if the I/O Wait value in the previous column is per second. </LI></UL></P>'),
(46, 'PGSPLWT', '<P>This chart shows an overview of spooler file I/O wait times by programs, where &quot;programs&quot; are all processes running from the same program object file. <UL> <LI><B>Program File Name</B>: Program file name. <LI><B>Total Opens</B>: Number of times this file has been opened.<LI><B>Logical I/Os per Sec</B>: Flags for non-zero lock waits (L), timeouts (T) and escalations (E).<LI><B>Cumulative Share pct(%)</B>: Cumulative share of all Spooler file I/O wait times. <table style=''border:0''> <tr><td style=''width: 20px; background:blue; padding:0px 0px 0px 0px; border:0''></td><td style=''border:0''>Share %</td></tr> </table> <LI><B>Individual Share pct(%)</B>: Program&#39;s share of all Spooler file I/O wait times. <LI><B>Program Spooler File I/O Wait Shares(Share pct(%))</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. </LI></UL><BR><BR><B>NOTE</B>: An exclamation point (<B>!</B>) following a Program File Name indicates that processes in the group are believed not to be using Level 3 Spooling.</P>'),
(61, 'PGSQLWT', '<P>This chart shows NonStop SQL Statement wait time distribution within a given partial Program File Name. All executions of a Statement by the same (Program-File-Name, Run-Unit, Statement-Index) combination are summed before this table/chart is produced. It is ordered by descending elapsed busy time (summed over all executions of the statement by all processes run from the Program File Name), so the Statements on which the program object spends the longest time waiting are at the top of the list. <UL> <LI><B>Run Unit Name</B>: The SQL Run Unit Name. <LI><B>Statement Index</B>: The Statement Index. <LI><B>Selectivity pct(%)</B>: Statement&#39;s &quot;selectivity&quot; (total records used divided by total records accessed, expressed as a percentage). <LI><B>Characteristics</B>: Flags for non-zero sorts (S), recompiles (R), lock waits (L), timeouts (T)and/or escalations (E). <LI><B>Wait Share pct(%)</B>: Statement&#39;s share of program&#39;s total elapsed busy time. <LI><B>Program SQL Statement Wait Time Distribution(Share as pct(%) age of Total)</B>: This is the bar chart showing the above value graphically on a percentage scale. Blue denotes the percentage value. </LI></UL></P>'),
(16, 'PIOBDEV', '<P>This report shows the busiest disk files on each device, in terms of physical I/Os (MEASURE &quot;Driver calls&quot; minus Cache Hits). <UL> <LI><B>Physical Device</B>: The device where the disk file is located. <LI><B>Volume</B>: The volume name where the disk file is located. <LI><B>SubVolume</B>: The subvolume name where the disk file is located. <LI><B>File Name</B>: The disk file name. <LI><B>Total Opens</B>: Number of times this file has been opened.<LI><B>System I/O Share pct(%)</B>: System I/Os as percentage of device total. <LI><B>Physical I/O Share pct(%)</B>: Physical I/Os as percentage of device total. <LI><B>Total Requests Blocked</B>: Total requests blocked (lock waits) NOT rated. <LI><B>Block Splits per Sec</B>: Number of Block Splits per second. <LI><B>Total System I/Os per Sec</B>: Total System I/Os per Second. <LI><B>Total Physical I/Os per Sec</B>: Total Physical I/Os per Second (System I/Os minus Cache Hits). <LI><B>Total Cache Hit pct(%)</B>: Total Cache Hit %. <LI><B>Input System I/Os per Sec</B>: Input System I/Os per Second. <LI><B>Input Physical I/Os per Sec</B>: Input Physical I/Os per Second (System I/Os minus Cache Hits). <LI><B>Input Cache Hit pct(%)</B>: Input Cache Hit %. <LI><B>Output System I/Os per Sec</B>: Output System I/Os per Second. <LI><B>Output Physical I/Os per Sec</B>: Output Physical I/Os per Second (System I/Os minus Cache Hits). <LI><B>Output Cache Hit pct(%)</B>: Output Cache Hit %. </LI></UL></P>'),
(72, 'PIOBVOL', '<P>This report shows the busiest disk files on each volume, in terms of physical I/Os (MEASURE &quot;Driver calls&quot; minus Cache Hits). <UL> <LI><B>Volume</B>: The volume where the disk file belongs. <LI><B>Subvol</B>: The subvolume where the disk file belongs. <LI><B>File Name</B>: The file name. <LI><B>Total Opens</B>: Number of times this file has been opened.<LI><B>System I/O Share pct(%)</B>: System I/Os as percentage of volume total. <LI><B>Physical I/O Share pct(%)</B>: Physical I/Os as percentage of volume total. <LI><B>Total Requests Blocked</B>: Total requests blocked (lock waits) NOT rated. <LI><B>Block Splits per Sec</B>: Number of block splits per second. <LI><B>Total System I/Os per Sec</B>: Total system I/Os per second. <LI><B>Total Physical I/Os per Sec</B>: Total physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Total Cache Hit pct(%)</B>: Total cache hit percentage. <LI><B>Input System I/Os per Sec</B>: Input system I/Os per second. <LI><B>Input Physical I/Os per Sec</B>: Input physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Input Cache Hit pct(%)</B>: Input cache hit percentage. <LI><B>Output System I/Os per Sec</B>: Output system I/Os per second. <LI><B>Output Physical I/Os per Sec</B>: Output physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Output Cache Hit pct(%)</B>: Output cache hit percentage. </LI></UL></P>'),
(17, 'PIOOVER', '<P>This report shows the busiest disk files on all volumes, in terms of physical I/Os (MEASURE &quot;Driver calls&quot; minus Cache Hits). <UL> <LI><B>$Volume</B>: The volume name where the disk file is located. <LI><B>SubVolume</B>: The subvolume name where the disk file is located. <LI><B>File Name</B>: The disk file name. <LI><B>Total Opens</B>: Number of times this file has been opened.<LI><B>Physical I/O Share pct(%) of GLOBAL</B>: Physical I/Os as percentage of global total. <LI><B>Cumulative I/O Share pct(%) of GLOBAL</B>: Cumulative percentage of above. <LI><B>Total Requests Blocked</B>: Total requests blocked (lock waits) NOT rated. <LI><B>Block Splits per Sec</B>: Number of Block Splits per second. <LI><B>Total System I/Os per Sec</B>: Total System I/Os per Second. <LI><B>Total Physical I/Os per Sec</B>: Total Physical I/Os per Second (System I/Os minus Cache Hits). <LI><B>Total Cache Hit pct(%)</B>: Total Cache Hit %. <LI><B>Input System I/Os per Sec</B>: Input System I/Os per Second. <LI><B>Input Physical I/Os per Sec</B>: Input Physical I/Os per Second (System I/Os minus Cache Hits). <LI><B>Input Cache Hit pct(%)</B>: Input Cache Hit %. <LI><B>Output System I/Os per Sec</B>: Output System I/Os per Second. <LI><B>Output Physical I/Os per Sec</B>: Output Physical I/Os per Second (System I/Os minus Cache Hits). <LI><B>Output Cache Hit pct(%)</B>: Output Cache Hit %. </LI></UL></P>'),
(18, 'PMEMCPU', '<P>This report shows the processes in each CPU that used the most real memory over the measurement window. <UL> <LI><B>Process</B>: Process name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>IPU Number</B>: the number of the IPU on which the process was executing when the sample was taken.<LI><B>IPU Switches</B>: Indicates the total number of times that a process switched IPUs while executing.<LI><B>Priority</B>: Priority of the process. <LI><B>Program File Name</B>: The program file name. <LI><B>Flag &#39;*&#39;</B>: Indication whether the process was running for less than the percentage of time specified by the FLAG parameter. <LI><B>Average Individual (MB)</B>: Average memory (MB) used (individual). <LI><B>Average Cumulative (MB)</B>: Average memory (MB) used (cumulative). <LI><B>CPU Busy pct(%)</B>: CPU utilization (as percentage of measurement window). <LI><B>Ready:Busy</B>: Ratio of total ready time to CPU busy time. <LI><B>Messages Received per Sec</B>: Messages received per second. <LI><B>Messages Sent per Sec</B>: Messages sent per second. <LI><B>Average Bytes per Message Received</B>: Average byte sizes of messages received. <LI><B>Average Bytes per Message Reply</B>: Average byte sizes of replies. <LI><B>Average Bytes per Message Sent</B>: Average byte sizes of messages sent. <LI><B>Average Bytes per Message Returned</B>: Average bytes returned. </LI></UL></P>'),
(62, 'PRIDIST', '<P>This chart shows the utilization of each CPU at each active process priority. <UL> <LI><B>Priority</B>: The active process priority. <LI><B>CPU n</B>: The utilization for that particular CPU by processes running at the given priority. <LI><B>Total</B>: The total utilization across all CPUs by processes running at the given priority. </LI></UL></P>'),
(70, 'PROFILE', '<P>This report profiles application programs and their logical I/O activity. For each unique program filename, it produces one set of data aggregated over all running copies of the program. <BR><BR> This report may cover NonStop process pairs. It attempts to allow for this fact by considering, and reporting, &quot;messages received&quot; to be (MESSAGES-RECEIVED - CHECKPOINTS). This should be pretty accurate for programs that use the standard Guardian Checkpointing facility, since one CHECKPOINT by the primary process equals one MESSAGE-RECEIVED by the backup process. <BR><BR> This compensation will not work for process pairs that implement fault-tolerance using &quot;hot&quot; backups and regular I/O to keep their backups current, since the CHECKPOINTS counter will be zero for such programs. However, the backup process(es) should show up as files opened by the primary process(es), and hence should show up in the right-hand half of this report. <UL> <LI><B>$Volume</B>: Volume name. <LI><B>Subvol</B>: Subvolume name. <LI><B>File Name</B>: Program file name. <LI><B>Process Count</B>: Count of processes run from program file. <LI><B>Average Process Life (sec)</B>: Average Process Life in second(s).<LI><B>Average Message Received per Process</B>: Average Message Received per Process.<LI><B>K</B>: Not Used.</LI></UL> <BR> The following items, expressed as values per &quot;message received&quot; or per second. If &quot;per second&quot;, values are followed by a lower-case &#39;s&#39; in the &#39;s#&#39; column: <UL> <LI><B>CPU Busy (ms)</B>: CPU Busy in milliseconds.<LI><B>Memory Busy (ms)</B>: Memory Busy in milliseconds.<LI><B>I/O Wait (ms)</B>: Milliseconds spent waiting for logical I/O.<LI>For each file (opened by any copy of the program):  <UL>  <LI><B>Volume</B>: Volume name (preceded by &#39;+&#39; sign if it&#39;s a remote file).  <LI><B>SubVolume</B>: Subvolume name. <LI><B>File Name</B>: File name. <LI><B>Total</B>: Number of logical I/O&#39;s, in total.  <LI><B>Reads</B>: Number of logical Read I/O&#39;s. <LI><B>Updates</B>: Number of logical Update I/O&#39;s. <LI><B>Deletes</B>: Number of logical Delete I/O&#39;s. <LI><B>Writes</B>: Number of logical Write I/O&#39;s. </LI>  </UL> </LI></UL></P>'),
(34, 'PROGLIO', '<P>This report shows the logical I/O activities of copies of a selected program. <UL> <LI><B>Process Name</B>: The Guardian process name of the process. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>Priority</B>: The execution priority of the process. <LI><B>Program File Name</B>: The PROGRAM object file name. This report shows all processes running from any program object file. <LI><B>From Time (hh:mm)</B>: The time at which measurement of the process began. <LI><B>To Time (hh:mm)</B>: The time at which measurement of the process ended. <LI><B>Elapsed (sec)</B>: The elapsed time of the process&#39; measurement, to the nearest second. Compare this to the overall report &#39;Window&#39;, shown at the head of each page to identify relatively short-lived processes. <LI><B>Flag &#39;*&#39;</B>: Indication whether the process was running for less than the percentage of time specified by the FLAG parameter. <LI><B>Flag &#39;+&#39;</B>: A plus sign (+) in this column indicates whether the program is from another system. <LI><B>Opened File Name</B>: The name of the File to which the remaining report columns relate. Since MEASURE may record a File open before it records the opening Process itself, this report ALLOWs the starting timestamps of File records to be up to 5.00 seconds earlier than that of the opening Process . <LI><B>Logical Reads</B>: The average number of logical reads from the file. For disk files, these may be random or sequential reads, and may or may not wait on, or acquire, record or file locks. <LI><B>Logical Updates</B>: The average number of logical updates to the file (typically, rewrites following reads). For $RECEIVE (if shown), the value in this column is the average number of replies (to messages received) per second. Note: $RECEIVE is NOT shown. <LI><B>Logical Deletes</B>: For disk files, the average number of logical deletes from the file (typically, following reads). For terminal and process files, the average number of WRITEREADs to the file. <LI><B>Logical Writes</B>: The average number of logical writes to the file. For disk files, these may be random or sequential writes. <LI><B>Information Calls</B>: For disk files only, the average number of calls to FILEINFO or FILERECINFO, specifying a <filenum> parameter, for which the File System must communicate with one or more Disk Processes in order to obtain the requested information from File Control Block(s). <LI><B>Total I/Os</B>: The sum of the I/O columns above; remember, this value is averaged over the report Window, NOT the life of the process. <LI><B>I/O Wait (ms)</B>: The average number of milliseconds per second that the process waited for completion of logical I/O requests to the file. </LI></UL></P>'),
(19, 'PTIMLIN', '<P>This report shows the number of processes existing in each of 16 time intervals. Width of interval, in minutes, is specified by the user (PARAM INTERVAL <mm>), or is computed by the query. <UL> <LI><B>File Name</B>: Program file name. <LI><B>Total</B>: Total number of executions found. <LI><B>MM/DD/YYYY HH:MM:SS - # Processes</B>: Number of processes existing for at least part of each interval. </LI></UL></P>'),
(47, 'RCBCHRT', '<P>This chart shows the relative CPU &quot;balance&quot;; the measure of &quot;balance&quot; is each CPU&#39;s CPU-QTIME expressed as a percentage of the sum of all CPU&#39;s CPU-QTIMEs (shown as &quot;Indivdl CPU Busy %&quot; in the chart). <UL> <LI><B>CPU</B>: The CPU Number. <LI><B>Type</B>: The processor type of the CPU. <LI><B>CPU Queue Length</B>: Total CPU Queuing. <LI><B>Individual Share pct(%)</B>: Each CPU&#39;s CPU-QTIME expressed as a percentage of the sum of all CPU&#39;s CPU-QTIMEs. <LI><B>Cumulative Share pct(%)</B>: Cumulative share of all Spooler file I/O wait times. Note: Memory Queuing % will always be zero. This is because as of G05, the handling of page-faulting is a system library function. No queuing occurs because multiple requests are processed concurrently. <LI><B>Memory Queuing pct(%)</B>: The percentage (%) a process spent waiting on page faults<LI><B>CPU Queuing pct(%)</B>: The percentage (%) all processes spent on the ready list, including time spent waiting on page faults<LI><B>CPU Usage pct(%)</B>: The percentage (%) that the CPU was busy.<LI><B>Relative CPU Balance (Share pct(%))</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. The share is further broken down to show the contributions by Memory queuing (blue), Other CPU queuing (orange) and Actual CPU utilization (green). Rolling over the appropriate colors show the % contribution for that component. In a well-balanced, steady-state, system with adequate capacity for instantaneous peaks, you would expect to see: <UL> <LI>1. An almost-vertical right-hand edge to the chart, <LI>2. No blue color memory queuing, and <LI>3. Lesser orange compared to green. </LI></UL><br> For faster CPU models, it may be acceptable for the share of CPU queuing to exceed that of CPU Usage, since each queued request can be serviced more rapidly. </LI></UL></P>'),
(63, 'RDBCHRT', '<P>This chart shows relative disk device &quot;balance&quot;; the measure of &quot;balance&quot; is each device&#39;s total queuing time (external queuing plus internal queuing and service) expressed as a percentage of the sum of all devices&#39; total queuing time (shown as Shr% in the chart). <UL> <LI><B>$Device</B>: The device name. An asterisk(*) denotes a CLIM Device.<LI><B>Requests per Sec</B>: The number of requests per second. <LI><B>Response Time (ms)</B>: The response time in milliseconds. <LI><B>Requests Blocked</B>: the number of times an operation had to wait because the requested file or record was already locked.<LI><B>Share pct(%)</B>: Percentage share of the device&#39;s total queuing and service time. <LI><B>Cumulative Share pct(%)</B>: The cumulative share of the device queuing and service times. Blue denotes the external queuing while green denotes the internal queuing + service time. <LI><B>External Queuing pct(%)</B>: The percentage (%) of requests waiting to be read by the disk process.<LI><B>Internal Queuing pct(%)</B>: The percentage (%) of requests read by the disk process.<LI><B>Relative Disk Balance (Share pct(%))</B>: Graphical representation of the above value, with breakdown for External Queuing and Internal Queuing + Service. </LI></UL></P>'),
(41, 'REQBLKD', '<P>This chart shows which disk files are experiencing the most requests blocked, ordered by descending requests blocked (summed over all opens of any given file/partition). Only files experiencing requests blocked are shown. <UL> <LI><B>Program File Name</B>: The disk file name. <LI><B>Total Requests Blocked</B>: Total number of requests blocked. <LI><B>Cumulative Share pct(%)</B>: Cumulative share of total requests blocked. <LI><B>Share pct(%)</B>: Individual share of total requests blocked. <LI><B>Disk File &#39;Requests Blocked&#39; Shares(Share pct(%))</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. </LI></UL></P>'),
(6,  'SERVICE', '<P>This report summarizes server process information.&nbsp;&nbsp;In particular, it shows the average time that requests for service spent waiting in processes&#39; message input queues, and the estimated service time and utilization levels of server processes. <br><br>Server processes are assumed to get transaction requests from their external message queues (that is, from their &#39;$RECEIVE&#39; files).<br><br>Columns Logical I/O&#39;s, CPU Busy, CPU Wait, Memory Wait and I/O Wait show average values per transaction. <UL> <LI><B>Process Name</B>: The Guardian process name of the server process.</LI> <LI><B>Process ID (CPU|PIN)</B>: The process identification (cpu,pin).</LI> <LI><B>Priority</B>: The execution priority of the process.</LI> <LI><B>Program File Name - Volume, SubVolume and File Name</B>: The server program object file name.&nbsp;&nbsp;This report shows information for one or more running copies of the program (&#39;processes&#39;).&nbsp;&nbsp;see note of Transactions per Second column.</LI> <LI><B>From Time (hh:mm)</B>: The time at which measurement of the process began.</LI> <LI><B>To Time (hh:mm)</B>: The time at which measurement of the process ended.</LI> <LI><B>Elapsed (sec)</B>: To Time minus From Time, to the nearest second.&nbsp;&nbsp;An asterisk (*) following the value FLAGs that this time is less than 90% of the report &#39;Window&#39;.</LI> <LI><B>Flag &#39;*&#39;</B>: Transient process.<LI><B>Transactions per Sec</B>: The number of transactions per second handled by the process; this report EXCLUDEs processes that handled less than 0.10 transactions per second.</LI> <LI><B>Average Received Queue (ms)</B>: The average time, in milliseconds, that requests for service waited in the process&#39; message queue.<br><br>If this is a PATHWAY server process, there may be additional queuing of requests for this process<br><br>WITHIN one or more TCPs; a TCP will typically not SEND a request to a server process that it knows is busy servicing a request on its behalf.</LI> <LI><B>Estimated Service Time (ms)</B>: The estimated average service time of the process; that is, the estimated average time, in milliseconds, between the time the process begins work on a new transaction and the time it completes work on that transaction.&nbsp;&nbsp;This estimate INCLUDES the possible effects of CPU queuing, memory page faults, and the queuing and service times of other processes that service this process&#39; logical I/O requests.<BR><BR>CARE SHOULD BE TAKEN WHEN EVALUATING THIS ESTIMATE, since it assumes that the process handles (and completes) incoming requests one at a time, using &#39;waited&#39; I/O; the estimate will be questionable (&#39;?&#39; follows) or invalid (&#39;X&#39; follows) if:<BR>a) The above is not true, or<BR>b) The report could not match the process to its open of its $RECEIVE file (FILE $RECEIVE not MEASURE&#39;d, or PARAM ALLOW value of 5.00 seconds is too small to allow process-to-file matching in this MEASURE data).<BR><BR>Some knowledge of the application is desirable to verify that the estimate provided here is plausible. </LI> <LI><B>X/?</B>: "X" - Process never waited on $RECEIVE this is definitely not a vanilla server, so tell report reader. "?" - Process seems busier than sum of CPU Busy, CPU Wait, Memory Wait and  I/O wait - looks suspicious. " " - Looks plausible.<LI><B>Estimated Busy pct(%)</B>: The estimated utilization of the process, expressed as a percentage of the report &#39;Window&#39;, NOT of the life of the process itself; based on estimated service time see Estimated service Time.</LI> <LI><B>File Open Counter</B>: Number of times this file has been opened.<LI><B>Logical I/O&#39;s (Average per Transaction)</B>: Logical I/O requests to MEASURE&#39;d files.</LI> <LI><B>CPU Busy (Average per Transaction)</B>: Milliseconds spent actively using the CPU.</LI> <LI><B>CPU Wait (Average per Transaction)</B>: Milliseconds spent waiting to use the CPU.</LI> <LI><B>Memory Wait (Average per Transaction)</B>: Milliseconds spent waiting for Memory Manager service.</LI> <LI><B>I/O Wait (Average per Transaction)</B>: Milliseconds spent waiting for completion of logical I/O requests to MEASUREd files.&nbsp;&nbsp;This excludes any time spent waiting for &#39;any file&#39; nowait I/O&#39;s to complete.</LI> </UL> </P>'),
(4,  'SERVLIO', '<P>This report shows the average logical file I/O activity of server processes<br><br>Columns Logical I/O&#39;s and I/O Wait show values averaged over the number of transactions handled by the process or, if column Transactions per Second is zero, over the report &#39;Window&#39; seconds values followed by &#39;s&#39;. <UL> <LI><B>Process Name</B>: The Guardian process name of the server process.</LI> <LI><B>Process ID (CPU|PIN)</B>: The server process identification (cpu,pin).</LI> <LI><B>Priority</B>: The execution priority of the server process. </LI> <LI><B>Program File Name</B>: The server program object file name.&nbsp;&nbsp;This report shows information for one or more running copies of the program (&#39;processes&#39;), see note for column Transactions per Second.</LI> <LI><B>From Time (hh:mm)</B>: The time at which measurement of the process began.</LI> <LI><B>To Time (hh:mm)</B>: The time at which measurement of the process ended.</LI> <LI><B>Transactions per Sec</B>: The number of transactions per second handled by the process; this report EXCLUDEs processes that handled less than 0.10 transactions per second.<LI><B>Flag &#39;*&#39;</B>: An asterisk (*) following this FLAGs that the file named in File-$Volume/File-SubVolume/File-FileName was open for less than the percentage of time of the process&#39; elapsed time specified by the FLAG parameter.&nbsp;&nbsp;This may indicate the (normally) poor programming practice of repeatedly opening, accessing and closing the file.<LI><B>Flag &#39;*&#39;</B>: (*) The name of the File to which the remaining report columns relate. Since MEASURE may record a File open before it records the opening Process itself, this report ALLOWs the starting timestamps of File records to be up to 5.00 seconds earlier than that of the opening Process.<LI><B>Flag &#39;+&#39;</B>: (A plus (+) in front of this name indicates that the file resides on a system other than the one running the process).</LI> <LI><B>Files Opened</B>: The filename process which the server program object opened.</LI> <LI><B>Logical I/O&#39;s Read</B>: The average number of logical reads from the file.&nbsp;&nbsp;For disk files, these may be random or sequential reads, and may or may not wait on, or acquire, record or file locks.</LI> <LI><B>Logical I/O&#39;s Update</B>: The average number of logical updates to the file (typically, rewrites following reads).&nbsp;&nbsp;For $RECEIVE (if shown), the value in this column is the average number of replies (to messages received).<br>Note: $RECEIVE is NOT shown by default</LI> <LI><B>Logical I/O&#39;s Delete</B>: For disk files, the average number of logical deletes from the file (typically, following reads).&nbsp;&nbsp;For terminal and process files, the average number of WRITEREADs to the file.</LI> <LI><B>Logical I/O&#39;s Write</B>: The average number of logical writes to the file.&nbsp;&nbsp;For disk files, these may be random or sequential writes.</LI> <LI><B>Logical I/O&#39;s Information</B>: For disk files only, the average number of calls to FILEINFO or FILERECINFO, specifying a <filenum> parameter, for which the File System must communicate with one or more Disk Processes in order to obtain the requested information from File Control Block(s).</LI> <LI><B>Logical I/O&#39;s Total</B>: The sum of columns Logical I/O&#39;s Read, Logical I/O&#39;s Update, Logical I/O&#39;s Delete, Logical I/O&#39;s Write and Logical I/O&#39;s Info; remember, this value is averaged over either &#39;Trans Count&#39;, or report &#39;Window&#39; &#39;s&#39;.</LI> <LI><B>I/O Wait (ms)</B>: The average number of milliseconds per transaction (or per second, if preceded by &#39;s&#39;) that the process waited for completion of all logical I/O requests to the file. <BR><BR> Files are ordered by the DESCENDING value of this column for each process; thus, logical I/O&#39;s to the FIRST file listed for a process are contributing the MOST to that process&#39; overall logical I/O wait time.&nbsp;&nbsp;Note that any time spent in the AWAITIO(X) procedure waiting for I/O completion on &#39;any file&#39; (<filenum> parameter = -1) is NOT included in these times. <BR><BR> Note also that you can derive the &#39;average milliseconds per logical I/O&#39; by dividing Logical I/O&#39;s Total into I/O Wait.</LI> </UL> </P>'),
(5,  'SERVPIO', '<P>This report shows the average physical disk I/O activity of server process<br><br>Columns Input System I/O&#39;s, Input Cache Hits, Input Physical I/O&#39;s, Output System I/O&#39;s, Output Cache Hits and Output Physical I/O&#39;s show values averaged over the number of transactions handles by the process. <UL> <LI><B>Program File Name</B>: The server program object file name.&nbsp;&nbsp;This report shows information for one or more running copies of the program (&#39;processes&#39;), see note of Transactions Count column.</LI> <LI><B>From Time (hh:mm:ss)</B>: The time of day (HH:MM:SS) at which measurement of the process began.</LI> <LI><B>To Time (hh:mm:ss)</B>: The time of day (HH:MM:SS) at which measurement of the process ended</LI> <LI><B>Elapsed (sec)</B>: The elapsed time of the process&#39; measurement, to the nearest second.&nbsp;&nbsp;Compare this to the overall measurement &#39;Window&#39; shown at the head of each page to identify relatively short-lived processes.</LI> <LI><B>Process Name</B>: The Guardian process name of the process.</LI> <LI><B>Transactions Count</B>: The TOTAL number of transactions handled by the process; this report EXCLUDEs processes that handled less than 0.10 transactions per second.<LI><B>Flag &#39;*&#39;</B>:An asterisk (*) in this column FLAGs that the file named in Disk-$Volume/Disk-SubVolume/Disk-FileName column was open for less than 90% of the process&#39; elapsed time. This may indicate the (normally) poor programming practice of repeatedly opening, accessing and closing the file.</LI> <LI><B>Files Opened</B>: The name of the Disk File to which the remaining report columns relate.&nbsp;&nbsp;Since MEASURE may record a Disk File Open slightly before it records the opening Process itself, this report ALLOWs the starting timestamps of Disk File Open records to be up to 5.00 seconds earlier than that of the opening Process.</LI> <LI><B>Input System I/O&#39;s</B>: The average number of Disk Process &#39;driver&#39; input calls for the file.&nbsp;&nbsp;A driver input call represents a need to read a file block; thus, one logical random read request to a key-sequenced file will result in multiple driver input calls - to access index block(s) and the required data block.&nbsp;&nbsp;Some or all of the required blocks may already be in the volume&#39;s Disk Cache; this is indicated by the next column ...</LI> <LI><B>Input Cache Hits</B>: The average number of read operations that were satisfied from the volume&#39;s Disk Cache, thereby saving a physical read operation.</LI> <LI><B>Input Physical I/O&#39;s</B>: The average number of physical read operations from the disk itself.</LI> <LI><B>Output System I/O&#39;s</B>: The average number of Disk Process &#39;driver&#39; output calls for the file.&nbsp;&nbsp;A driver output call represents a need to write a file block because part of it has been modified.&nbsp;&nbsp;Again, one logical write, update or delete request may require more than one block to be modified, and hence more than one driver output call.</LI> <LI><B>Output Cache Hits</B>: If a block to be modified (as counted by Output System I/O&#39;s, above) is already in the volume&#39;s Disk Cache, and is already marked as &#39;dirty&#39; (previously modified), then no physical write operation has yet occurred for the previous modification.&nbsp;&nbsp;Thus, a physical write operation has been saved, and the &#39;cache write hits&#39; value in this column is incremented.</LI> <LI><B>Output Physical I/O&#39;s</B>: The average number of physical write operations to the volume.&nbsp;&nbsp;Note that if this is a mirrored volume, there will actually be TWO such physical write operations.</LI> </UL> </P>'),
(20, 'SIOBDEV', '<P>This report shows the busiest disk files on each device, in terms of &quot;system I/Os&quot; (MEASURE &quot;Driver calls&quot;, that may or may not be satisfied from Disk Cache). <UL> <LI><B>Physical Device</B>: The device name. <LI><B>Volume</B>: The volume where the disk file belongs. <LI><B>SubVolume</B>: The subvolume where the disk file belongs. <LI><B>File Name</B>: The disk file name. <LI><B>Total Opens</B>: Number of times this file has been opened.<LI><B>System I/O Share pct(%)</B>: System I/Os as percentage of device total. <LI><B>Physical I/O Share pct(%)</B>: Physical I/Os as percentage of device total. <LI><B>Total Requests Blocked</B>: Total requests blocked (lock waits) NOT rated. <LI><B>Block Splits per Sec</B>: Total number of Block Splits per second. <LI><B>Total System I/Os per Sec</B>: Total System I/Os per second. <LI><B>Total Physical I/Os per Sec</B>: Total Physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Total Cache Hit pct(%)</B>: Total Cache hit percentage. <LI><B>Input System I/Os per Sec</B>: Input System I/Os per second. <LI><B>Input Physical I/Os per Sec</B>: Input Physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Input Cache Hit pct(%)</B>: Input Cache hit percentage. <LI><B>Output System I/Os per Sec</B>: Output System I/Os per second. <LI><B>Output Physical I/Os per Sec</B>: Output Physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Output Cache Hit pct(%)</B>: Output Cache hit percentage. </LI></UL></P>'),
(69, 'SIOBVOL', '<P>This report shows the busiest disk files on each volume, in terms of &quot;system I/Os&quot; (MEASURE &quot;Driver calls&quot;, that may or may not be satisfied from Disk Cache). The report aggregates all OPENs of the same file in to one report line. All counts are in units per second. <UL> <LI><B>$Volume</B>: Volume name. <LI><B>Subvol</B>: Subvolume. <LI><B>File Name</B>: File name. <LI><B>Opens</B>: Number of times this file has been opened.<LI><B>System I/O Share pct(%)</B>: System I/Os as percentage of volume total. <LI><B>Physical I/O Share pct(%)</B>: Physical I/Os as percentage of volume total. <LI><B>Total Requests Blocked</B>: Total requests blocked (lock waits) NOT rated. <LI><B>Block Splits per Sec</B>: Number of block splits per second. <LI><B>Total System I/Os per Sec</B>: Total system I/Os per second. <LI><B>Total Physical I/Os per Sec</B>: Total physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Total Cache Hit pct(%)</B>: Total cache hit percentage. <LI><B>Input System I/Os per Sec</B>: Input system I/Os per second. <LI><B>Input Physical I/Os per Sec</B>: Input physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Input Cache Hit pct(%)</B>: Input cache hit percentage. <LI><B>Output System I/Os per Sec</B>: Output system I/Os per second. <LI><B>Output Physical I/Os per Sec</B>: Output physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Output Cache Hit pct(%)</B>: Output cache hit percentage. </LI></UL></P>'),
(32, 'SIOOVER', '<P>This report shows the busiest disk files on all volumes, in terms of &quot;system I/Os&quot; (MEASURE &quot;Driver calls&quot;, that may or may not be satisfied from Disk Cache). <UL> <LI><B>$Volume.SubVol.FileName</B>: Fully qualified file name. <LI><B>Total Opens</B>: Number of times this file has been opened.<LI><B>System I/O Share pct(%) of GLOBAL</B>: System I/Os as percentage of global total. <LI><B>Cumulative Share pct(%) of GLOBALL</B>: Cumulative percentage of the System I/O share. <LI><B>Total Request Blocked</B>: Total requests blocked (lock waits) NOT rated. <LI><B>Total Block Splits</B>: The total number of block splits (per block size) for the volume.<LI><B>Total System I/Os per Sec</B>: Total System I/Os per second. <LI><B>Total Physical I/Os per Sec</B>: Total Physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Total Cache Hit pct(%)</B>: Total Cache hit percentage. <LI><B>Input System I/Os per Sec</B>: Input System I/Os per second. <LI><B>Input Physical I/Os per Sec</B>: Input Physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Input Cache Hit pct(%)</B>: Input Cache hit percentage. <LI><B>Output System I/Os per Sec</B>: Output System I/Os per second. <LI><B>Output Physical I/Os per Sec</B>: Output Physical I/Os per second (System I/Os minus Cache Hits). <LI><B>Output Cache Hit pct(%)</B>: Output Cache hit percentage. </LI></UL></P>'),
(21, 'SQLDETL', '<P>This report shows the individual NonStop SQL Statement executions. <UL> <LI><B>Process Name</B>: Process name. <LI><B>Process ID (CPU|PIN)</B>: The PID cpu,pin of the process. <LI><B>Priority</B>: The PID cpu,pin of the opening process. <LI><B>Program File Name</B>: The program file name. <LI><B>From Time (hh:mm)</B>: Process start time. <LI><B>To Time (hh:mm)</B>: Process end time. <LI><B>Run Unit Name</B>: Name of the run unit. <LI><B>Statement Index</B>: SQL statement index. <LI><B>Times Called</B>: Number of times statement was executed. <LI><B>(sec) per Call</B>: Average elapsed seconds per statement execution. <LI><B>Time Shared pct(%)</B>: Program&#39;s share of the total elapsed busy time, expressed as a percentage. <LI><B>Access Share pct(%)</B>: Program&#39;s share of the total records accessed, expressed as a percentage. <LI><B>Selectivity pct(%)</B>: Average statement selectivity (records used divided by records accessed). <LI><B>Flag</B>: A pound sign (#) if no records accessed, an exclamation point (!) if no records used. <LI><B>Characteristics</B>: Flags to indicate &quot;undesirable&quot; characteristics: Statement caused one or more sorts (S), Statement was recompiled at least once (R), Statement encountered one or more lock waits (L), Statement encountered one or more timeouts (T), Statement caused one or more lock escalations (E). </LI></UL></P>'),
(64, 'SQLPROG', '<P>This chart provides an overview of NonStop SQL programs. It is ordered by descending elapsed busy time (summed over all SQL Statements executed by all processes run from each Program File Name), so the program objects which spend the longest time waiting for SQL statement executions are at the top of the list. <UL> <LI><B>Program File Name</B>: The name of the program file whose processes execute the SQL statements. <LI><B>Selectivity pct(%)</B>: Program&#39;s overall &quot;selectivity&quot; (total records used divided by total records accessed, expressed as a percentage). <LI><B>Characteristics</B>: Flags for non-zero sorts (S), recompiles (R), lock waits (L), timeouts (T) and/or escalations (E). <LI><B>Cumulative Wait Share pct(%)</B>: Cumulative share of total elapsed busy time. Blue denotes the % share of the total elapsed busy time. <LI><B>Wait Share pct(%)</B>: Program&#39;s individual share of total elapsed busy time. <LI><B>NonStop SQL Program Overview(Share pct(%))</B>: A graphical representation of the above value. </LI></UL></P>'),
(76, 'SQLSTAN', '<P>This report shows the record retrieval performance individual NonStop SQL Statement executions.<UL><LI><B>Program Filename</B>: File system name, qualified file name.<LI><B>Run Unit</B>: The external-format ANSI SQL name.<LI><B>Statement Index</B>: Statement index number within the specified run unit. This number correspond to the section location table (SLT) index numbers on compiler listings.<LI><B>Calls</B>: The number of times the measured SQL statement was executed.<LI><B>Messages</B>: The number of messages sent by the system on behalf of this statement, including messages sent by the file system to the disk process and messages sent by the SQL executor to the SQL compiler for recompiles.<LI><B>Records Pct(%)</B>: The percentage (%) of records inserted, updated, deleted, or read by the SQL executor through this statement.<LI><B>Records Used</B>: The number of records inserted, updated, deleted, or read by the SQL executor through this statement.<LI><B>Records Accessed</B>: The number of records accessed by the disk process or file system to evaluate this statement.<LI><B>Disk Reads</B>: The number of physical disk reads performed for this statement.<LI><B>Sorts per Minute</B>: The number of times, per minute, an external sort process was invoked for this statement.<LI><B>Sorts per Call</B>: The number of times, per call, an external sort process was invoked for this statement.<LI><B>Escalations</B>: The number of times a record lock was escalated to a file lock.<LI><B>Lock Wait</B>: The number of times this statement waited for a lock request.<LI><B>Time Outs</B>: The number of times a request timed out. A timeout is caused by either a lock-wait or a congested disk process or network.<LI><B>(sec) per Call</B>: Average elapsed seconds per statement execution. (ELAPSED-BUSY-TIME/CALLS).</LI></UL></p>'),
(65, 'SQLSTAT', '<P>This report identifies the longest-running SQL statements. These are NOT individual executions of a statement, but sums of executions of the same logical statement by all running copies of programs that contain the statement. All executions of a statement by the same (Program-File-Name, Run-Unit, Statement-Index) combination are summed before this table is produced. It is ordered by descending elapsed busy time (summed over all executions of the statement by all processes run from the Program File Name). <UL> <LI><B>Program File Name</B>: The name of the program file whose processes execute the SQL statements. <LI><B>Run Unit Name</B>: The name of the SQL Run Unit. <LI><B>Statement Index</B>: The Statement Index. <LI><B>Selectivity pct(%)</B>: Statement&#39;s &quot;selectivity&quot; (total records used divided by total records accessed, expressed as a percentage). <LI><B>Wait Share pct(%)</B>: Statement&#39;s share of system&#39;s total elapsed busy time. </LI></UL></P>'),
(22, 'SYSREPT', '<P>This report shows the EXPAND inter-system message and packet traffic. <UL> <LI><B>Originating System</B>: The name of the originating system (that is, the local system). <LI><B>Destination System</B>: The name of the destination system (that is, the remote system). <LI><B>Links</B>: The total number of MESSAGES (each consisting of one or more PACKETS) sent from the local system to the remote system. This value does NOT include Level-4 acknowledgment messages. <LI><B>Average Links (Messages) per Sec</B>: The average number of MESSAGES (each consisting of one or more PACKETS) sent per second from the local system to the remote system. This value does NOT include Level-4 acknowledgment messages. <LI><B>Average Links Time (sec)</B>: The average time in seconds spent waiting on the acknowledgment from the remote system of the message sent to it by the local system. <LI><B>Packets per Second - Sent</B>: Packets created and sent by the local system to the remote system per second. <LI><B>Packets per Second - Received</B>: Packets sent from the remote system to the local system, with the local system as their final destination, per second. <LI><B>Packets per Second - Sent Forward</B>: Packets sent by the local system to the remote system on behalf of another system in the network, per second. <LI><B>Packets per Second - Received Forward</B>: Packets sent from the remote system to the local system to be forwarded to another system in the network, per second. <LI><B>Packets per Link - Sent</B>: Packets created and sent by the local system to the remote system, per link. <LI><B>Packets per Link - Received</B>: Packets sent from the remote system to the local system, with the local system as their final destination, per link. <LI><B>Packets per Link - Sent Forward</B>: Packets sent by the local system to the remote system on behalf of another system in the network, per link. <LI><B>Packets per Link - Received Forward</B>: Packets sent from the remote system to the local system to be forwarded to another system in the network, per link. </LI></UL></P>'),
(23, 'TMFREPT', '<P>This report shows the TMF transaction activity in each CPU. There are four &quot;types&quot; of transactions: 1. Transactions begun in the given CPU, 2. Transactions begun in this system, and distributed to at least one other system; these are reported only in the primary TMP&#39;s CPU, 3. Transactions begun on some other system, and distributed to this system; these are reported only in the primary TMP&#39;s CPU, 4. Transactions that were backed out on this system. <UL> <LI><B>CPU</B>: CPU Number. <LI><B>Begun At Home - Transactions per Sec</B>: Average transactions per second (for transactions begun in the given CPU). <LI><B>Begun At Home - Average Count</B>: Average number of transactions active (for transactions begun in the given CPU). <LI><B>Begun At Home - Maximum Count</B>: Maximum number of transactions active (for transactions begun in the given CPU). This field is obsolete and is reported as zero. <LI><B>Begun At Home - Average (sec) Active</B>: Average life of a transaction, in seconds (for transactions begun in the given CPU). <LI><B>Home To Remote - Transactions per (sec</B>: Average transactions per second (for transactions begun in this system and distributed to at least one other system). <LI><B>Home To Remote - Average Count</B>: Average number of transactions active (for transactions begun in this system and distributed to at least one other system). <LI><B>Home To Remote - Maximum Count</B>: Maximum number of transactions active (for transactions begun in this system and distributed to at least one other system). This field is obsolete and is reported as zero. <LI><B>Home To Remote - Average (sec) Active</B>: Average life of a transaction, in seconds (for transactions begun in this system and distributed to at least one other system). <LI><B>Remote To Home - Transactions per Sec</B>: Average transactions per second (for transactions begun on some other system and distributed to this system). <LI><B>Remote To Home - Average Count</B>: Average number of transactions active (for transactions begun on some other system and distributed to this system). <LI><B>Remote To Home - Maximum Count</B>: Maximum number of transactions active (for transactions begun on some other system and distributed to this system). This field is obsolete and is reported as zero. <LI><B>Remote To Home - Average (sec) Active</B>: Average life of a transaction, in seconds (for transactions begun on some other system and distributed to this system). <LI><B>Backed Out - Transactions per Sec</B>: Average transactions per second (for transactions that were backed out on this system). <LI><B>Backed Out - Average Count</B>: Average number of transactions active (for transactions that were backed out on this system). <LI><B>Backed Out - Maximum Count</B>: Maximum number of transactions active (for transactions that were backed out on this system). This field is obsolete and is reported as zero. <LI><B>Backed Out - Average (sec) Active</B>: Average life of a transaction, in seconds (for transactions that were backed out on this system). <LI><B>Average Home Transaction Life (sec)</B>: The average sum, in seconds, of lifetimes of transactions originated in the measured CPU. This counter includes transactions regardless of whether they remain in the local system or are distributed to a remote system.<LI><B>Average Remote Transaction Life (sec)</B>: The average time, in seconds, that transactions began in a remote system and were distributed to the local system spent on the local system.</LI></UL></P>'),
(66, 'TMFVIEW', '<P>This report is a single-page overview of TMF activity and shows information in four categories: Transaction Rates & Elapsed Times, $TMP Process, Master Audit Trail Disk Process and Master Audit Trail Physical Disk(s). The following values are reported for each of the above categories: <br><br><UL><LI><B>TRANSACTION RATES/TIMES</B>: Home Transactions/Second, Average Home Transaction Life in seconds (both of these are reported as Total, Overall average, lowest per CPU average, and highest per CPU average), Remote Transactions/Second, Average Remote Transaction Life in seconds, Transaction Backouts/Second and Average Transaction Backout Life in seconds. <LI><B>$TMP PROCESS</B>: Average CPU Utilization and Average Receive Queue Time in milliseconds.<LI><B>MASTER AUDIT TRAIL VOLUME ($AUDIT)</B>: There is one section for each audit trail volume specified in the param list. Values reported include the Average CPU Utilization, Volume Requests/Second, Average Total Response Time in milliseconds, and the Receive Queue Time in milliseconds. <LI><B>PHYSICAL DISC ACTIVITY</B>: This section too repeats for each audit trail volume specified. Values reported include Bytes per Second (Input and Output), Average Bytes per I/O (Input and Output), I/O Operations per Second (Reads and Writes) and Average Device Utilization in percentage (Write and Read). </LI></UL></P>'),
(48, 'WKLOAD',  '<P>This chart shows an overview of the apportioned CPU consumption, ordered by descending apportioned consumption, so the programs that consume most apportioned CPU time are at the top of the list. Interrupt busy time and Disk Process CPU busy time are apportioned to programs (all processes running from a given Program code file) based on message traffic and (cache hits and physical I/Os), respectively. <UL> <LI><B>Program File Name</B>: Program file name. <LI><B>Individual Share pct(%)</B>: Program&#39;s apportioned share of total CPU consumption. <LI><B>Cumulative Share pct(%)</B>: Cumulative apportioned share of total CPU consumption. <LI><B>Interrupt Share pct(%)</B>: Interrupt apportioned share of total CPU consumption. <LI><B>Disk Process pct(%)</B>: Disk process(es) utilization.<LI><B>User pct(%)</B>: User(s) utilization.<LI><B>Apportioned Program CPU Consumption(Share pct(%))</B>: This is the bar chart showing the above value graphically on a percentage (0-100) scale. The share is further broken down to show the contributions by Interrupt (blue), Disk Process (green) and User (orange). Rolling over the appropriate colors show the % contribution for that component. </LI></UL></P>');
